INSERT INTO `mdl_cache_text` VALUES (1,'a061a6bed9722d87d64982569efc3081','<div class=\"no-overflow\"><p>Welcome to the course! Introduce yourself on the discussion forum.</p></div>',1345581098),(2,'05179813d36d1ac1392372ffdb3cc5b2','<div class=\"no-overflow\"><p>In this session, you will explore foundationalfraction concepts by using visual representations and manipulatives, including fraction circles and bars.</p></div>',1345581098),(3,'94e5843b2184d841101da9f90d998687','<div class=\"no-overflow\"><p>In this session, you will learn about the importance of the number line representation for fractions as well as the challenges it poses for students. You will experience a formative assessment probe and then sort student work samples to identify common misconceptions. Then, you will explore different instructional approaches for addressing student difficulties.</p></div>',1345581098),(4,'4bffa1578a84de7bb6e9e256e65e2108','<div class=\"no-overflow\"><p>Explore ways to use number line representations to build understanding of equivalent fractions and density (finding in-between fractions). Use formative assessment probes and learn about different student misconceptions. Examine work samples in depth for individual students.</p></div>',1345581098),(5,'d917d15d04241512160d0252818ad82a','<div class=\"no-overflow\"><p>In this session, you will choose a path that allows you to further explore and apply ideas from Sessions 1-3.</p></div>',1345581098),(6,'c70495bc6aece7d7311bf03667c4f74b','<div class=\"no-overflow\"><p>Explore approaches for building conceptual understanding of fraction addition and subtraction.</p></div>',1345581098),(7,'94695bf14954f079d5fcdb7dabaee186','<div class=\"no-overflow\"><p>Connect conceptual and procedural approaches to fraction addition and subtraction.</p></div>',1345581098),(8,'39e664a6d14dd1da1f12cb30be5948c0','<div class=\"no-overflow\"><p>Apply ideas with your students by choosing from three differentiated paths.</p></div>',1345581098),(9,'0615caf972ae72dd5130f05b666ba38d','<div class=\"no-overflow\"><p><span style=\"color: #ff0000;\">Text in red</span></p></div>',1345646713),(10,'dbb3cf90db495d01ab8a79c710010036','<div class=\"no-overflow\"><p>asdfasdfasdf</p></div>',1345581424),(11,'efd4d9a2aef66a21f24f88ada3c48eca','<div class=\"no-overflow\"><p>asdfasdf</p></div>',1345646718),(12,'5ca664cb2d8b6db0fba299478aafd2f8','<div class=\"no-overflow\"><p>asdfasdfasd</p></div>',1345646825);
