ural approaches to fraction addition and subtraction.</p>',1,NULL,1),(42,5,8,'Session 7:  Applying Ideas in Your Practice','<p>Apply ideas with your students by choosing from three differentiated paths.</p>',1,'37',1),(43,6,0,NULL,NULL,1,'40',1),(44,6,1,'Day 1','',1,'',0),(45,6,2,NULL,'',1,'45',1),(46,6,3,NULL,'',1,'44',1);
