l strategy from the course.  Make a plan for using it with students.  Implement the strategy and reflect on your experience.',0,NULL,0),(12,2,7,0,0,0,0,1331585677,0,'Plan a sequence of formative assessment and instruction that incorporates probes and activities from the course.   Implement a lesson [a part?] from the sequence with your students.  Reflect on your experience.',0,NULL,0),(13,2,5,4,0,0,0,1331585201,0,'Go back to menu of assignments.',0,NULL,0);
