 every time you log in.','Two cookies are used by this site:\n\nThe essential one is the session cookie, usually called MoodleSession. You must allow this cookie into your browser to provide continuity and maintain your login from page to page. When you log out or close the browser this cookie is destroyed (in your browser and on the server).\n\nThe other cookie is purely for convenience, usually called something like MOODLEID. It just remembers your username within the browser. This means when you return to this site the username field on the login page will be already filled out for you. It is safe to refuse this cookie - you will just have to retype your username every time you log in.',NULL,1330401575,NULL,0,0),(233,'en_us',1,'cookiesnotenabled','Unfortunately, cookies are currently not enabled in your browser','Unfortunately, cookies are currently not enabled in your browser',NULL,1330401575,NULL,0,0),(234,'en_us',1,'copy','copy','copy',NULL,1330401575,NULL,0,0),(235,'en_us',1,'copyasnoun','copy','copy',NULL,1330401575,NULL,0,0),(236,'en_us',1,'copyingcoursefiles','Copying course files','Copying course files',NULL,1330401575,NULL,0,0),(237,'en_us',1,'copyingsitefiles','Copying site files used in course','Copying site files used in course',NULL,1330401575,NULL,0,0),(238,'en_us',1,'copyinguserfiles','Copying user files','Copying user files',NULL,1330401575,NULL,0,0),(239,'en_us',1,'copyingzipfile','Copying zip file','Copying zip file',NULL,1330401575,NULL,0,0),(240,'en_us',1,'copyrightnotice','Copyright notice','Copyright notice',NULL,1330401575,NULL,0,0),(241,'en_us',1,'coresystem','System','System',NULL,1330401575,NULL,0,0),(242,'en_us',1,'cost','Cost','Cost',NULL,1330401575,NULL,0,0),(243,'en_us',1,'costdefault','Default cost','Default cost',NULL,1330401575,NULL,0,0),(244,'en_us',1,'counteditems','{$a->count} {$a->items}','{$a->count} {$a->items}',NULL,1330401575,NULL,0,0),(245,'en_us',1,'country','Country','Country',NULL,1330401575,NULL,0,0),(246,'en_us',1,'c