e\na minute to create a new account for yourself on this web site.\nEach of the individual courses may also have a one-time\n\"enrollment key\", which you won\'t need until later. Here are\nthe steps:\n<ol>\n<li>Fill out the <a href=\"{$a}\">New Account</a> form with your details.</li>\n<li>An email will be immediately sent to your email address.</li>\n<li>Read your email, and click on the web link it contains.</li>\n<li>Your account will be confirmed and you will be logged in.</li>\n<li>Now, select the course you want to participate in.</li>\n<li>If you are prompted for an \"enrollment key\" - use the one\nthat your teacher has given you. This will \"enroll\" you in the\ncourse.</li>\n<li>You can now access the full course. From now on you will only need\nto enter your personal username and password (in the form on this page)\nto log in and access any course you have enrolled in.</li>\n</ol>',NULL,1330401577,NULL,0,0),(778,'en_us',1,'loginstepsnone','<p>Hi!</p>\n<p>For full access to courses you\'ll need to create yourself an account.</p>\n<p>All you need to do is make up a username and password and use it in the form on this page!</p>\n<p>If someone else has already chosen your username then you\'ll have to try again using a different username.</p>','<p>Hi!</p>\n<p>For full access to courses you\'ll need to create yourself an account.</p>\n<p>All you need to do is make up a username and password and use it in the form on this page!</p>\n<p>If someone else has already chosen your username then you\'ll have to try again using a different username.</p>',NULL,1330401577,NULL,0,0),(779,'en_us',1,'loginto','Login to {$a}','Login to {$a}',NULL,1330401577,NULL,0,0),(780,'en_us',1,'loginusing','Login here using your username and password','Login here using your username and password',NULL,1330401577,NULL,0,0),(781,'en_us',1,'logout','Logout','Logout',NULL,1330401577,NULL,0,0),(782,'en_us',1,'logoutconfirm','Do you really want to logout?','Do you really want to logout?',NUL