e.</p>\n<p>By default, your information will be kept private, and will never be sold or passed on to anyone else.  The only\n   reason for collecting this information is for support purposes, and to help build up a statistical\n   picture of the Moodle community as a whole.</p>\n<p>If you choose, you can allow your site name, country and URL to be added to the public list of Moodle Sites.</p>\n<p>All new registrations are verified manually before they are added to the list, but once you are added you can update your registration (and your entry on the public list) at any time by resubmitting this form.</p>',NULL,1330401578,NULL,0,0),(1102,'en_us',1,'registrationinfotitle','Registration information','Registration information',NULL,1330401578,NULL,0,0),(1103,'en_us',1,'registrationno','No, I do not want to receive email','No, I do not want to receive email',NULL,1330401578,NULL,0,0),(1104,'en_us',1,'registrationsend','Send registration information to moodle.org','Send registration information to moodle.org',NULL,1330401578,NULL,0,0),(1105,'en_us',1,'registrationyes','Yes, please notify me about important issues','Yes, please notify me about important issues',NULL,1330401578,NULL,0,0),(1106,'en_us',1,'reject','Reject','Reject',NULL,1330401578,NULL,0,0),(1107,'en_us',1,'rejectdots','Reject...','Reject...',NULL,1330401578,NULL,0,0),(1108,'en_us',1,'reload','Reload','Reload',NULL,1330401578,NULL,0,0),(1109,'en_us',1,'remoteappuser','Remote {$a} User','Remote {$a} User',NULL,1330401578,NULL,0,0),(1110,'en_us',1,'remove','Remove','Remove',NULL,1330401578,NULL,0,0),(1111,'en_us',1,'removeadmin','Remove admin','Remove admin',NULL,1330401578,NULL,0,0),(1112,'en_us',1,'removecreator','Remove course creator','Remove course creator',NULL,1330401578,NULL,0,0),(1113,'en_us',1,'removestudent','Remove student','Remove student',NULL,1330401578,NULL,0,0),(1114,'en_us',1,'removeteacher','Remove teacher','Remove teacher',NULL,1330401578,NULL,0,0),(1115,'en_us',1,'rename','Rename','Rename