 find in other people.</li></ul>','The scale based on the theory of separate and connected knowing. This theory describes two different ways that we can evaluate and learn about the things we see and hear.<ul><li><strong>Separate knowers</strong> remain as objective as possible without including feelings and emotions. In a discussion with other people, they like to defend their own ideas, using logic to find holes in opponent\'s ideas.</li><li><strong>Connected knowers</strong> are more sensitive to other people. They are skilled at empathy and tends to listen and ask questions until they feel they can connect and \"understand things from their point of view\". They learn by trying to share the experiences that led to the knowledge they find in other people.</li></ul>',NULL,1330401578,NULL,0,0),(1245,'en_us',1,'serverlocaltime','Server\'s local time','Server\'s local time',NULL,1330401578,NULL,0,0),(1246,'en_us',1,'setcategorytheme','Set category theme','Set category theme',NULL,1330401578,NULL,0,0),(1247,'en_us',1,'settings','Settings','Settings',NULL,1330401578,NULL,0,0),(1248,'en_us',1,'shortname','Short name','Short name',NULL,1330401578,NULL,0,0),(1249,'en_us',1,'shortnamecollisionwarning','[*] = This shortname is already in use by a course and will need to be changed upon approval','[*] = This shortname is already in use by a course and will need to be changed upon approval',NULL,1330401578,NULL,0,0),(1250,'en_us',1,'shortnamecourse','Course short name','Course short name',NULL,1330401578,NULL,0,0),(1251,'en_us',1,'shortnamecourse_help','The short name of the course is displayed in the navigation and is used in the subject line of course email messages.','The short name of the course is displayed in the navigation and is used in the subject line of course email messages.',NULL,1330401578,NULL,0,0),(1252,'en_us',1,'shortnametaken','Short name is already used for another course ({$a})','Short name is already used for another course ({$a})',NULL,1330401578,NULL,0