rom delete','Protect from delete',NULL,1330401579,NULL,0,0),(1643,'en_us',3,'blockprotect_help','Selected block instances will be protected from deletion from the site-wide context. This is primarily used to protect the navigation and settings blocks which can be very hard to get back if accidentally deleted.','Selected block instances will be protected from deletion from the site-wide context. This is primarily used to protect the navigation and settings blocks which can be very hard to get back if accidentally deleted.',NULL,1330401579,NULL,0,0),(1644,'en_us',3,'blockunprotect','Unprotect','Unprotect',NULL,1330401579,NULL,0,0),(1645,'en_us',3,'blocksettings','Manage blocks','Manage blocks',NULL,1330401579,NULL,0,0),(1646,'en_us',3,'bloglevel','Blog visibility','Blog visibility',NULL,1330401579,NULL,0,0),(1647,'en_us',3,'bloglevelupgrade','Blog visibility upgrade','Blog visibility upgrade',NULL,1330401579,NULL,0,0),(1648,'en_us',3,'bloglevelupgradedescription','<p>This site has recently been upgraded to Moodle 2.0.</p>\n<p>Blog visibility was simplified in 2.0, but your site still uses one of the old visibility types. </p>\n<p>To preserve the course-based or group-based visibility of the blog entries on your site, you need to run the following upgrade script, which will create a special \"blog\" type forum in each course whose enrolled users have posted blog entries, and will copy these blog entries in this special forum. </p>\n<p>Blogs will then be entirely switched off at the site level. No blog entries will be deleted in the process.</p>\n<p>You can run the script by visiting <a href=\"{$a->fixurl}\">the blog level upgrade page</a>.</p>','<p>This site has recently been upgraded to Moodle 2.0.</p> <p>Blog visibility was simplified in 2.0, but your site still uses one of the old visibility types. </p> <p>To preserve the course-based or group-based visibility of the blog entries on your site, you need to run the following upgrade script, which will create a special \"blog\" type forum in each course whose enrolled users have posted blog entries, and will copy these blog entries in this special forum. </p> <p>Blogs will then be entirely switched off at the site level. No blog entries will be deleted in the process.</p> <p>You can run the script by visiting <a href=\"{$a->fixurl}\">the blog level upgrade page</a>.</p>',NULL,1330401579,NULL,0,0),(1649,'en_us',3,'bloglevelupgradeinfo','Blog visibility was simplified in 2.0, but your site still uses one of the old visibility types. To preserve the course-based or group-based visibility of the blog entries on your site, the following upgrade script will create a special \"blog\" type forum in each course whose enrolled users have posted blog entries, and will copy these blog entries in this special forum. Blogs will then be entirely switched off at the site level. No blog entries will be deleted in the process.','Blog visibility was simplified in 2.0, but your site still uses one of the old visibility types. To preserve the course-based or group-based visibility of the blog entries on your site, the following upgrade script will create a special \"blog\" type forum in each course whose enrolled users have posted blog entries, and will copy these blog entries in this special forum. Blogs will then be entirely switched off at the site level. No blog entries will be deleted in the process.',NULL,1330401579,NULL,0,0),(1650,'en_us',3,'bloglevelupgradenotice','Your site is using an old blog visibility setting, the <a href=\"bloglevelupgrade.php\">blog visibility upgrade</a> is recommended.','Your site is using an old blog visibility setting, the <a href=\"bloglevelupgrade.php\">blog visibility upgrade</a> is recommended.',NULL,1330401579,NULL,0,0),(1651,'en_us',3,'bloglevelupgradeprogress','Conversion progress: {$a->userscount} users reviewed, {$a->blogcount} entries converted.','Conversion progress: {$a->userscount} users reviewed, {$a->blogcount} entries converted.',NULL,1330401579,NUL