lues that are used in the activity settings form when you create a new activity. You can also configure which activity settings are considered advanced.',NULL,1330401579,NULL,0,0),(1688,'en_us',3,'confeditorhidebuttons','Select the buttons that should be hidden in the HTML editor.','Select the buttons that should be hidden in the HTML editor.',NULL,1330401579,NULL,0,0),(1689,'en_us',3,'configallcountrycodes','This is the list of countries that may be selected in various places, for example in a user\'s profile. If blank (the default) the list in countries.php in the standard English language pack is used. That is the list from ISO 3166-1. Otherwise, you can specify a comma-separated list of codes, for example \'GB,FR,ES\'. If you add new, non-standard codes here, you will need to add them to countries.php in \'en\' and your language pack.','This is the list of countries that may be selected in various places, for example in a user\'s profile. If blank (the default) the list in countries.php in the standard English language pack is used. That is the list from ISO 3166-1. Otherwise, you can specify a comma-separated list of codes, for example \'GB,FR,ES\'. If you add new, non-standard codes here, you will need to add them to countries.php in \'en\' and your language pack.',NULL,1330401579,NULL,0,0),(1690,'en_us',3,'configallowassign','You can allow people who have the roles on the left side to assign some of the column roles to other people','You can allow people who have the roles on the left side to assign some of the column roles to other people',NULL,1330401579,NULL,0,0),(1691,'en_us',3,'configallowblockstodock','If enabled and supported by the selected theme users can choose to move blocks to a special dock.','If enabled and supported by the selected theme users can choose to move blocks to a special dock.',NULL,1330401579,NULL,0,0),(1692,'en_us',3,'configallowcategorythemes','If you enable this, then themes can be set at the category level. This will affect all child categories and courses unless they have specifically set their own theme. WARNING: Enabling category themes may affect performance.','If you enable this, then themes can be set at the category level. This will affect all child categories and courses unless they have specifically set their own theme. WARNING: Enabling category themes may affect performance.',NULL,1330401579,NULL,0,0),(1693,'en_us',3,'configallowcoursethemes','If you enable this, then courses will be allowed to set their own themes.  Course themes override all other theme choices (site, user, or session themes)','If you enable this, then courses will be allowed to set their own themes.  Course themes override all other theme choices (site, user, or session themes)',NULL,1330401579,NULL,0,0),(1694,'en_us',3,'configallowemailaddresses','If you want to restrict all new email addresses to particular domains, then list them here separated by spaces.  All other domains will be rejected.  To allow subdomains add the domain with a preceding \'.\'. eg <strong>ourcollege.edu.au .gov.au</strong>','If you want to restrict all new email addresses to particular domains, then list them here separated by spaces.  All other domains will be rejected.  To allow subdomains add the domain with a preceding \'.\'. eg <strong>ourcollege.edu.au .gov.au</strong>',NULL,1330401579,NULL,0,0),(1695,'en_us',3,'configallowobjectembed','As a default security measure, normal users are not allowed to embed multimedia (like Flash) within texts using explicit EMBED and OBJECT tags in their HTML (although it can still be done safely using the mediaplugins filter).  If you wish to allow these tags then enable this option.','As a default security measure, normal users are not allowed to embed multimedia (like Flash) within texts using explicit EMBED and OBJECT tags in their HTML (although it can still be done safely using the mediaplugins filter).  If you wish to allow these tags then enable this option.',NULL,1330401579,NULL,0,0),(1696,'en_us',3,'configallowoverride','You can allow people with the roles on the left side to override some of the column roles','You can allow people with the roles on the left side to override some of the column roles',NULL,1330401579,NULL,0,0),(1697,'en_us',3,'configallowoverride2','Select which role(s) can be overridden by each role in the left column.<br />Note that these settings only apply to users who have either the capability moodle/role:override or the capability moodle/role:safeoverride allowed.','Select which role(s) can be overridden by each role in the left column.<br />Note that these settings only apply to users who have either the capability moodle/role:override or the capability moodle/role:safeoverride allowed.',NULL,1330401579,NULL,0,0),(1698,'en_us',3,'configallowswitch','Select which roles a user may switch to, based on which roles they already have. In addition to an entry in this table, a user must also have the moodle/role:switchroles capability to be able to switch.<br />Note that it is only possible to switch to roles that have the moodle/course:view capability, and that do not have the moodle/site:doanything capability, so some columns in this table are disabled.','Select which roles a user may switch to, based on which roles they already have. In addition to an entry in this table, a user must also have the moodle/role:switchroles capability to be able to switch.<br />Note that it is only possible to switch to roles that have the moodle/course:view capability, and that do not have the moodle/site:doanything capability, so some columns in this table are disabled.',NULL,1330401579,NULL,0,0),(1699,'en_us',3,'configallowthemechangeonurl','If enabled, the theme can be changed by adding theme={themename} to any Moodle URL.','If enabled, the theme can be changed by adding theme={themename} to any Moodle URL.',NULL,1330401579,NULL,0,0),(1700,'en_us',3,'configallowuserblockhiding','Do you want to allow users to hide/show side blocks throughout this site?  This feature uses Javascript and cookies to remember the state of each collapsible block, and only affects the user\'s own view.','Do you want to allow users to hide/show side blocks throughout this site?  This feature uses Javascript and cookies to remember the state of each collapsible block, and only affects the user\'s own view.',NULL,1330401579,NULL,0,0),(1701,'en_us',3,'configallowusermailcharset','Enabling this, every user in the site will be able to specify his own charset for email.','Enabling this, every user in the site will be able to specify his own charset for email.',NULL,1330401579,NULL,0,0),(1702,'en_us',3,'configallowuserswitchrolestheycantassign','By default, moodle/role:assign is required for users to switch roles. Enabling this setting removes this requirement, and results in the roles available in the \"Switch role to\" dropdown menu being determined by settings in the \"Allow role assignments\" table only.\nIt is recommended that the settings in the \"Allow role assignments\" table do not allow users to switch to a role with more capabilities than their existing role.','By default, moodle/role:assign is required for users to switch roles. Enabling this setting removes this requirement, and results in the roles available in the \"Switch role to\" dropdown menu being determined by settings in the \"Allow role assignments\" table only.\nIt is recommended that the settings in the \"Allow role assignments\" table do not allow users to switch to a role with more capabilities than their existing role.',NULL,1330401579,NULL,0,0),(1703,'en_us',3,'configallowuserthemes','If you enable this, then users will be allowed to set their own themes.  User themes override site themes (but not course themes)','If you enable this, then users will be allowed to set their own themes.  User themes override site themes (but not course themes)',NULL,1330401579,NULL,0,0),(1704,'en_us',3,'configallusersaresitestudents','For activities on the front page of the site, should ALL users be considered as students?  If you answer \"Yes\", then any confirmed user account will be allowed to participate as a student in those activities.  If you answer \"No\", then only users who are already a participant in at least one course will be able to take part in those front page activities. Only admins and specially assigned teachers can act as teachers for these front page activities.','For activities on the front page of the site, should ALL users be considered as students?  If you answer \"Yes\", then any confirmed user account will be allowed to participate as a student in those activities.  If you answer \"No\", then only users who are already a participant in at least one course will be able to take part in those front page activities. Only admins and specially assigned teachers can act as teachers for these front page activities.',NULL,1330401579,NULL,0,0),(1705,'en_us',3,'configauthenticationplugins','Please choose the authentication plugins you wish to use and arrange them in order of failthrough.','Please choose the authentication plugins you wish to use and arrange them in order of failthrough.',NULL,1330401579,NULL,0,0),(1706,'en_us',3,'configautolang','Detect default language from browser setting, if disabled site default is used.','Detect default language from browser setting, if disabled site default is used.',NULL,1330401579,NULL,0,0),(1707,'en_us',3,'configautologinguests','Should visitors be logged in as guests automatically when entering courses with guest access?','Should visitors be logged in as guests automatically when entering courses with guest access?',NULL,1330401579,NULL,0,0),(1708,'en_us',3,'configbloglevel','This setting allows you to restrict the level to which user blogs can be viewed on this site.  Note that they specify the maximum context of the VIEWER not the poster or the types of blog posts.  Blogs can also be disabled completely if you don\'t want them at all.','This setting allows you to restrict the level to which user blogs can be viewed on this site.  Note that they specify the maximum context of the VIEWER not the poster or the types of blog posts.  Blogs can also be disabled completely if you don\'t want them at all.',NULL,1330401579,NULL,0,0),(1709,'en_us',3,'configcachetext','For larger sites or sites that use text filters, this setting can really speed things up.  Copies of texts will be retained in their processed form for the time specified here.  Setting this too small may actually slow things down slightly,  but setting it too large may mean texts take too long to refresh (with new links, for example).','For larger sites or sites that use text filters, this setting can really speed things up.  Copies of texts will be retained in their processed form for the time specified here.  Setting this too small may actually slow things down slightly,  but setting it too large may mean texts take too long to refresh (with new links, for example).',NULL,1330401579,NULL,0,0),(1710,'en_us',3,'configcachetype','Select a type of cache for Moodle to use. This will only configure the cache, remember to enable rcache so that the cache is used for something. Use <strong>only</strong> if you need to reduce the load on the database system -- otherwise Moodle will actually run slower. Medium-traffic sites may see benefits using \'internal\'. A single webserver with eAccelerator or Turckmmcache installed <em>with the shared memory options enabled</em> should try \'eaccelerator\'. If you have a multiple-server setup, and you have one or more memcached daemons running and the PHP-memcached extension, select \'memcached\' and configure the memached options below. <br /><strong>Note:</strong> make sure you test performance under load and tune accordingly -- the caches can make your site slower. In high-traffic situations, eAccelerator and memcached can yield the most benefits, but have the higher costs in CPU usage on the webserver.','Select a type of cache for Moodle to use. This will only configure the cache, remember to enable rcache so that the cache is used for something. Use <strong>only</strong> if you need to reduce the load on the database system -- otherwise Moodle will actually run slower. Medium-traffic sites may see benefits using \'internal\'. A single webserver with eAccelerator or Turckmmcache installed <em>with the shared memory options enabled</em> should try \'eaccelerator\'. If you have a multiple-server setup, and you have one or more memcached daemons running and the PHP-memcached extension, select \'memcached\' and configure the memached options below. <br /><strong>Note:</strong> make sure you test performance under load and tune accordingly -- the caches can make your site slower. In high-traffic situations, eAccelerator and memcached can yield the most benefits, but have the higher costs in CPU usage on the webserver.',NULL,1330401579,NULL,0,0),(1711,'en_us',3,'configcalendarexportsalt','This random text is used for improving of security of authentication tokens used for exporting of calendars. Please note that all current tokens are invalidated if you change this hash salt.','This random text is used for improving of security of authentication tokens used for exporting of calendars. Please note that all current tokens are invalidated if you change this hash salt.',NULL,1330401579,NULL,0,0),(1712,'en_us',3,'configclamactlikevirus','Treat files like viruses','Treat files like viruses',NULL,1330401579,NULL,0,0),(1713,'en_us',3,'configclamdonothing','Treat files as OK','Treat files as OK',NULL,1330401579,NULL,0,0),(1714,'en_us',3,'configclamfailureonupload','If you have configured clam to scan uploaded files, but it is configured incorrectly or fails to run for some unknown reason, how should it behave?  If you choose \'Treat files like viruses\', they\'ll be moved into the quarantine area, or deleted. If you choose \'Treat files as OK\', the files will be moved to the destination directory like normal. Either way, admins will be alerted that clam has failed.  If you choose \'Treat files like viruses\' and for some reason clam fails to run (usually because you have entered an invalid pathtoclam), ALL files that are uploaded will be moved to the given quarantine area, or deleted. Be careful with this setting.','If you have configured clam to scan uploaded files, but it is configured incorrectly or fails to run for some unknown reason, how should it behave?  If you choose \'Treat files like viruses\', they\'ll be moved into the quarantine area, or deleted. If you choose \'Treat files as OK\', the files will be moved to the destination directory like normal. Either way, admins will be alerted that clam has failed.  If you choose \'Treat files like viruses\' and for some reason clam fails to run (usually because you have entered an invalid pathtoclam), ALL files that are uploaded will be moved to the given quarantine area, or deleted. Be careful with this setting.',NULL,1330401579,NULL,0,0),(1715,'en_us',3,'configconvertformat','If <i>latex</i>, <i>dvips</i> and <i>convert</i> are available, the images are created using the specified format. If it is not, mimeTeX will be used and it will create GIF images.','If <i>latex</i>, <i>dvips</i> and <i>convert</i> are available, the images are created using the specified format. If it is not, mimeTeX will be used and it will create GIF images.',NULL,1330401579,NULL,0,0),(1716,'en_us',3,'configcookiehttponly','Enables new PHP 5.2.0 feature - browsers are instructed to send cookie with real http requests only, cookies should not be accessible by scripting languages. This is not supported in all browsers and it may not be fully compatible with current code. It helps to prevent some types of XSS attacks.','Enables new PHP 5.2.0 feature - browsers are instructed to send cookie with real http requests only, cookies should not be accessible by scripting languages. This is not supported in all browsers and it may not be fully compatible with current code. It helps to prevent some types of XSS attacks.',NULL,1330401579,NULL,0,0),(1717,'en_us',3,'configcookiesecure','If server is accepting only https connections it is recommended to enable sending of secure cookies. If enabled please make sure that web server is not accepting http:// or set up permanent redirection to https:// address. When <em>wwwroot</em> address does not start with https:// this setting is turned off automatically.','If server is accepting only https connections it is recommended to enable sending of secure cookies. If enabled please make sure that web server is not accepting http:// or set up permanent redirection to https:// address. When <em>wwwroot</em> address does not start with https:// this setting is turned off automatically.',NULL,1330401579,NULL,0,0),(1718,'en_us',3,'configcountry','If you set a country here, then this country will be selected by default on new user accounts.  To force users to choose a country, just leave this unset.','If you set a country here, then this country will be selected by default on new user accounts.  To force users to choose a country, just leave this unset.',NULL,1330401579,NULL,0,0),(1719,'en_us',3,'configcourserequestnotify','Type username of user to be notified when new course requested.','Type username of user to be notified when new course requested.',NULL,1330401579,NULL,0,0),(1720,'en_us',3,'configcourserequestnotify2','Users who will be notified when a course is requested. Only users who can approve course requests are listed here.','Users who will be notified when a course is requested. Only users who can approve course requests are listed here.',NULL,1330401579,NULL,0,0),(1721,'en_us',3,'configcoursesperpage','Enter the number of courses to be display per page in a course listing.','Enter the number of courses to be display per page in a course listing.',NULL,1330401579,NULL,0,0),(1722,'en_us',3,'configcronclionly','If this is set, then the cron script can only be run from the command line instead of via the web.  This overrides the cron password setting below.','If this is set, then the cron script can only be run from the command line instead of via the web.  This overrides the cron password setting below.',NULL,1330401579,NULL,0,0),(1723,'en_us',3,'configcronremotepassword','This means that the cron.php script cannot be run from a web browser without supplying the password using the following form of URL:<pre>\n    http://site.example.com/admin/cron.php?password=opensesame\n</pre>If this is left empty, no password is required.','This means that the cron.php script cannot be run from a web browser without supplying the password using the following form of URL:<pre>\n    http://site.example.com/admin/cron.php?password=opensesame\n</pre>If this is left empty, no password is required.',NULL,1330401579,NULL,0,0),(1724,'en_us',3,'configcurlcache','Time-to-live for cURL cache, in seconds.','Time-to-live for cURL cache, in seconds.',NULL,1330401579,NULL,0,0),(1725,'en_us',3,'configcustommenuitems','You can configure a custom menu here to be shown by themes. Each line consists of some menu text, a link URL (optional) and a tooltip title (optional), separated by pipe characters. You can specify a structure using hyphens. For example:\n<pre>\nMoodle community|http://moodle.org\n-Moodle free support|http://moodle.org/support\n-Moodle development|http://moodle.org/development\n--Moodle Tracker|http://tracker.moodle.org\n--Moodle Docs|http://docs.moodle.org\n-Moodle News|http://moodle.org/news\nMoodle company\n-Moodle commercial hosting|http://moodle.com/hosting\n-Moodle commercial support|http://moodle.com/support\n</pre>','You can configure a custom menu here to be shown by themes. Each line consists of some menu text, a link URL (optional) and a tooltip title (optional), separated by pipe characters. You can specify a structure using hyphens. For example:\n<pre>\nMoodle community|http://moodle.org\n-Moodle free support|http://moodle.org/support\n-Moodle development|http://moodle.org/development\n--Moodle Tracker|http://tracker.moodle.org\n--Moodle Docs|http://docs.moodle.org\n-Moodle News|http://moodle.org/news\nMoodle company\n-Moodle commercial hosting|http://moodle.com/hosting\n-Moodle commercial support|http://moodle.com/support\n</pre>',NULL,1330401579,NULL,0,0),(1726,'en_us',3,'configdbsessions','If enabled, this setting will use the database to store information about current sessions.  This is especially useful for large/busy sites or sites built on cluster of servers.  For most sites this should probably be left disabled so that the server disk is used instead.  Note that changing this setting now will log out all current users (including you). If you are using MySQL please make sure that \'max_allowed_packet\' in my.cnf (or my.ini) is at least 4M.','If enabled, this setting will use the database to store information about current sessions.  This is especially useful for large/busy sites or sites built on cluster of servers.  For most sites this should probably be left disabled so that the server disk is used instead.  Note that changing this setting now will log out all current users (including you). If you are using MySQL please make sure that \'max_allowed_packet\' in my.cnf (or my.ini) is at least 4M.',NULL,1330401579,NULL,0,0),(1727,'en_us',3,'configdebug','If you turn this on, then PHP\'s error_reporting will be increased so that more warnings are printed.  This is only useful for developers.','If you turn this on, then PHP\'s error_reporting will be increased so that more warnings are printed.  This is only useful for developers.',NULL,1330401579,NULL,0,0),(1728,'en_us',3,'configdebugdisplay','Set to on, the error reporting will go to the HTML page. This is practical, but breaks XHTML, JS, cookies and HTTP headers in general. Set to off, it will send the output to your server logs, allowing better debugging. The PHP setting error_log controls which log this goes to.','Set to on, the error reporting will go to the HTML page. This is practical, but breaks XHTML, JS, cookies and HTTP headers in general. Set to off, it will send the output to your server logs, allowing better debugging. The PHP setting error_log controls which log this goes to.',NULL,1330401579,NULL,0,0),(1729,'en_us',3,'configdebugpageinfo','Enable if you want page information printed in page footer.','Enable if you want page information printed in page footer.',NULL,1330401579,NULL,0,0),(1730,'en_us',3,'configdebugsmtp','Enable verbose debug information during sending of email messages to SMTP server.','Enable verbose debug information during sending of email messages to SMTP server.',NULL,1330401579,NULL,0,0),(1731,'en_us',3,'configdebugstringids','This option is designed to help translators. It shows the language file and string id beside each string that is output. (Changing this setting will only take effect on the next page load.)','This option is designed to help translators. It shows the language file and string id beside each string that is output. (Changing this setting will only take effect on the next page load.)',NULL,1330401579,NULL,0,0),(1732,'en_us',3,'configdebugvalidators','Enable if you want to have links to external validator servers in page footer. You may need to create new user with username <em>w3cvalidator</em>, and enable guest access. These changes may allow unauthorized access to server, do not enable on production sites!','Enable if you want to have links to external validator servers in page footer. You may need to create new user with username <em>w3cvalidator</em>, and enable guest access. These changes may allow unauthorized access to server, do not enable on production sites!',NULL,1330401579,NULL,0,0),(1733,'en_us',3,'configdefaultallowedmodules','For the courses which fall into the above category, which modules do you want to allow by default <b>when the course is created</b>?','For the courses which fall into the above category, which modules do you want to allow by default <b>when the course is created</b>?',NULL,1330401579,NULL,0,0),(1734,'en_us',3,'configdefaulthomepage','This determines the home page for logged in users','This determines the home page for logged in users',NULL,1330401579,NULL,0,0),(1735,'en_us',3,'configdefaultrequestcategory','Courses requested by users will be automatically placed in this category.','Courses requested by users will be automatically placed in this category.',NULL,1330401579,NULL,0,0),(1736,'en_us',3,'configdefaultrequestedcategory','Default category to put courses that were requested into, if they\'re approved.','Default category to put courses that were requested into, if they\'re approved.',NULL,1330401579,NULL,0,0),(1737,'en_us',3,'configdefaultuserroleid','All logged in users will be given the capabilities of the role you specify here, at the site level, in ADDITION to any other roles they may have been given.  The default is the Authenticated user role.  Note that this will not conflict with other roles they have unless you prohibit capabilities, it just ensures that all users have capabilities that are not assignable at the course level (eg post blog entries, manage own calendar, etc).','All logged in users will be given the capabilities of the role you specify here, at the site level, in ADDITION to any other roles they may have been given.  The default is the Authenticated user role.  Note that this will not conflict with other roles they have unless you prohibit capabilities, it just ensures that all users have capabilities that are not assignable at the course level (eg post blog entries, manage own calendar, etc).',NULL,1330401579,NULL,0,0),(1738,'en_us',3,'configdeleteincompleteusers','After this period, old not fully setup accounts are deleted.','After this period, old not fully setup accounts are deleted.',NULL,1330401579,NULL,0,0),(1739,'en_us',3,'configdeleteunconfirmed','If you are using email authentication, this is the period within which a response will be accepted from users.  After this period, old unconfirmed accounts are deleted.','If you are using email authentication, this is the period within which a response will be accepted from users.  After this period, old unconfirmed accounts are deleted.',NULL,1330401579,NULL,0,0),(1740,'en_us',3,'configdenyemailaddresses','To deny email addresses from particular domains list them here in the same way.  All other domains will be accepted. To deny subdomains add the domain with a preceding \'.\'. eg <strong>hotmail.com yahoo.co.uk .live.com</strong>','To deny email addresses from particular domains list them here in the same way.  All other domains will be accepted. To deny subdomains add the domain with a preceding \'.\'. eg <strong>hotmail.com yahoo.co.uk .live.com</strong>',NULL,1330401579,NULL,0,0),(1741,'en_us',3,'configdigestmailtime','People who choose to have emails sent to them in digest form will be emailed the digest daily. This setting controls which time of day the daily mail will be sent (the next cron that runs after this hour will send it).','People who choose to have emails sent to them in digest form will be emailed the digest daily. This setting controls which time of day the daily mail will be sent (the next cron that runs after this hour will send it).',NULL,1330401579,NULL,0,0),(1742,'en_us',3,'configdisableuserimages','Disable the ability for users to change user profile images.','Disable the ability for users to change user profile images.',NULL,1330401579,NULL,0,0),(1743,'en_us',3,'configdisplayloginfailures','This will display information to selected users about previous failed logins.','This will display information to selected users about previous failed logins.',NULL,1330401579,NULL,0,0),(1744,'en_us',3,'configdocroot','Defines the path to the Moodle Docs. You can change this if you wish to have your own custom online documentation. However, if you do that make sure that the paths in your documentation follow the same format as http://docs.moodle.org.','Defines the path to the Moodle Docs. You can change this if you wish to have your own custom online documentation. However, if you do that make sure that the paths in your documentation follow the same format as http://docs.moodle.org.',NULL,1330401579,NULL,0,0),(1745,'en_us',3,'configdoctonewwindow','If you enable this, then links to Moodle Docs will be shown in a new window.','If you enable this, then links to Moodle Docs will be shown in a new window.',NULL,1330401579,NULL,0,0),(1746,'en_us',3,'configeditordictionary','This value will be used if aspell doesn\'t have dictionary for users own language.','This value will be used if aspell doesn\'t have dictionary for users own language.',NULL,1330401579,NULL,0,0),(1747,'en_us',3,'configeditorfontlist','Select the fonts that should appear in the editor\'s drop-down list.','Select the fonts that should appear in the editor\'s drop-down list.',NULL,1330401579,NULL,0,0),(1748,'en_us',3,'configemailchangeconfirmation','Require an email confirmation step when users change their email address in their profile.','Require an email confirmation step when users change their email address in their profile.',NULL,1330401579,NULL,0,0),(1749,'en_us',3,'configenableajax','This setting allows you to control the use of AJAX (advanced client/server interfaces using Javascript) across the whole site.  With this setting enabled users can still make a choice in their profile, otherwise AJAX is disabled for everybody.','This setting allows you to control the use of AJAX (advanced client/server interfaces using Javascript) across the whole site.  With this setting enabled users can still make a choice in their profile, otherwise AJAX is disabled for everybody.',NULL,1330401579,NULL,0,0),(1750,'en_us',3,'configenablecalendarexport','Enable exporting or subscribing to calendars.','Enable exporting or subscribing to calendars.',NULL,1330401579,NULL,0,0),(1751,'en_us',3,'configenablecomments','Enable comments','Enable comments',NULL,1330401579,NULL,0,0),(1752,'en_us',3,'configenablecourserequests','This will allow any user to request a course be created.','This will allow any user to request a course be created.',NULL,1330401579,NULL,0,0),(1753,'en_us',3,'configenableglobalsearch','This setting enables global text searching in resources and activities, it is not compatible with PHP 4.','This setting enables global text searching in resources and activities, it is not compatible with PHP 4.',NULL,1330401579,NULL,0,0),(1754,'en_us',3,'configenablegroupmembersonly','If enabled, access to activities can be restricted to group members only. This may result in an increased server load. In addition, gradebook categories must be set up in a certain way to ensure that activities are hidden from non-group members.','If enabled, access to activities can be restricted to group members only. This may result in an increased server load. In addition, gradebook categories must be set up in a certain way to ensure that activities are hidden from non-group members.',NULL,1330401579,NULL,0,0),(1755,'en_us',3,'configenablehtmlpurifier','Use HTML Purifier instead of KSES for cleaning of untrusted text. HTML Purifier is actively developed and is believed to be more secure, but it is more resource intensive. Expect minor visual differences in the resulting html code. Please note that embed and object tags can not be enabled, MathML tags and old lang tags are not supported.','Use HTML Purifier instead of KSES for cleaning of untrusted text. HTML Purifier is actively developed and is believed to be more secure, but it is more resource intensive. Expect minor visual differences in the resulting html code. Please note that embed and object tags can not be enabled, MathML tags and old lang tags are not supported.',NULL,1330401579,NULL,0,0),(1756,'en_us',3,'configenablerssfeeds','This switch will enable RSS feeds from across the site.  To actually see any change you will need to enable RSS feeds in the individual modules too - go to the Modules settings under Admin Configuration.','This switch will enable RSS feeds from across the site.  To actually see any change you will need to enable RSS feeds in the individual modules too - go to the Modules settings under Admin Configuration.',NULL,1330401579,NULL,0,0),(1757,'en_us',3,'configenablerssfeedsdisabled','It is not available because RSS feeds are disabled in all the Site. To enable them, go to the Variables settings under Admin Configuration.','It is not available because RSS feeds are disabled in all the Site. To enable them, go to the Variables settings under Admin Configuration.',NULL,1330401579,NULL,0,0),(1758,'en_us',3,'configenablerssfeedsdisabled2','RSS feeds are disabled at the server level. You need to enable them first in Server/RSS.','RSS feeds are disabled at the server level. You need to enable them first in Server/RSS.',NULL,1330401579,NULL,0,0),(1759,'en_us',3,'configenablesafebrowserintegration','This adds the choice \'Require Safe Exam Browser\' to the \'Browser security\' field on the quiz settings form. See http://www.safeexambrowser.org/ for more information.','This adds the choice \'Require Safe Exam Browser\' to the \'Browser security\' field on the quiz settings form. See http://www.safeexambrowser.org/ for more information.',NULL,1330401579,NULL,0,0),(1760,'en_us',3,'configenablestats','If you choose \'yes\' here, Moodle\'s cronjob will process the logs and gather some statistics.  Depending on the amount of traffic on your site, this can take awhile. If you enable this, you will be able to see some interesting graphs and statistics about each of your courses, or on a sitewide basis.','If you choose \'yes\' here, Moodle\'s cronjob will process the logs and gather some statistics.  Depending on the amount of traffic on your site, this can take awhile. If you enable this, you will be able to see some interesting graphs and statistics about each of your courses, or on a sitewide basis.',NULL,1330401579,NULL,0,0),(1761,'en_us',3,'configenabletrusttext','By default Moodle will always thoroughly clean text that comes from users to remove any possible bad scripts, media etc that could be a security risk.  The Trusted Content system is a way of giving particular users that you trust the ability to include these advanced features in their content without interference.  To enable this system, you need to first enable this setting, and then grant the Trusted Content permission to a specific Moodle role.  Texts created or uploaded by such users will be marked as trusted and will not be cleaned before display.','By default Moodle will always thoroughly clean text that comes from users to remove any possible bad scripts, media etc that could be a security risk.  The Trusted Content system is a way of giving particular users that you trust the ability to include these advanced features in their content without interference.  To enable this system, you need to first enable this setting, and then grant the Trusted Content permission to a specific Moodle role.  Texts created or uploaded by such users will be marked as trusted and will not be cleaned before display.',NULL,1330401579,NULL,0,0),(1762,'en_us',3,'configenablewebservices','Web services enable other systems to log in to this Moodle and perform operations.  For extra security this feature should be disabled unless you are really using it.','Web services enable other systems to log in to this Moodle and perform operations.  For extra security this feature should be disabled unless you are really using it.',NULL,1330401579,NULL,0,0),(1763,'en_us',3,'configenablewsdocumentation','Enable auto-generation of web services documentation. A user can access to his own documentation on his security keys page {$a}. It displays the documentation for the enabled protocols only.','Enable auto-generation of web services documentation. A user can access to his own documentation on his security keys page {$a}. It displays the documentation for the enabled protocols only.',NULL,1330401579,NULL,0,0),(1764,'en_us',3,'configerrorlevel','Choose the amount of PHP warnings that you want to be displayed.  Normal is usually the best choice.','Choose the amount of PHP warnings that you want to be displayed.  Normal is usually the best choice.',NULL,1330401579,NULL,0,0),(1765,'en_us',3,'configexcludeoldflashclients','Some versions of the Adobe Flash plugin are known to be vulnerable to attacks from malicious Flash content.  You can specify a minimum supported version here, and Moodle will not show Flash files to users with lower versions. Instead they will see an alternate Flash file telling them how to upgrade. Leave this empty to disable all checks.','Some versions of the Adobe Flash plugin are known to be vulnerable to attacks from malicious Flash content.  You can specify a minimum supported version here, and Moodle will not show Flash files to users with lower versions. Instead they will see an alternate Flash file telling them how to upgrade. Leave this empty to disable all checks.',NULL,1330401579,NULL,0,0),(1766,'en_us',3,'configextendedusernamechars','Enable this setting to allow students to use any characters in their usernames (note this does not affect their actual names).  The default is \"false\" which restricts usernames to be alphanumeric lowercase characters, underscore (_), hyphen (-), period (.) or at symbol (@).','Enable this setting to allow students to use any characters in their usernames (note this does not affect their actual names).  The default is \"false\" which restricts usernames to be alphanumeric lowercase characters, underscore (_), hyphen (-), period (.) or at symbol (@).',NULL,1330401579,NULL,0,0),(1767,'en_us',3,'configextramemorylimit','Some scripts like search, backup/restore or cron require more memory. Set higher values for large sites.','Some scripts like search, backup/restore or cron require more memory. Set higher values for large sites.',NULL,1330401579,NULL,0,0),(1768,'en_us',3,'configextrauserselectorfields','Select which fields are searched and displayed, in addition to full names, when selecting users, for example when assigning roles or when adding users to a group. For security reasons, it is recommended that the username field is NOT selected.','Select which fields are searched and displayed, in addition to full names, when selecting users, for example when assigning roles or when adding users to a group. For security reasons, it is recommended that the username field is NOT selected.',NULL,1330401579,NULL,0,0),(1769,'en_us',3,'configfilterall','Filter all strings, including headings, titles, navigation bar and so on.  This is mostly useful when using the multilang filter, otherwise it will just create extra load on your site for little gain.','Filter all strings, including headings, titles, navigation bar and so on.  This is mostly useful when using the multilang filter, otherwise it will just create extra load on your site for little gain.',NULL,1330401579,NULL,0,0),(1770,'en_us',3,'configfiltermatchoneperpage','Automatic linking filters will only generate a single link for the first matching text instance found on the complete page. All others are ignored.','Automatic linking filters will only generate a single link for the first matching text instance found on the complete page. All others are ignored.',NULL,1330401579,NULL,0,0),(1771,'en_us',3,'configfiltermatchonepertext','Automatic linking filters will only generate a single link for the first matching text instance found in each item of text (e.g., resource, block) on the page. All others are ignored. This setting is ignored if the one per page setting is <i>yes</i>.','Automatic linking filters will only generate a single link for the first matching text instance found in each item of text (e.g., resource, block) on the page. All others are ignored. This setting is ignored if the one per page setting is <i>yes</i>.',NULL,1330401579,NULL,0,0),(1772,'en_us',3,'configfilteruploadedfiles','Process all uploaded HTML and text files with the filters before displaying them, only uploaded HTML files or none at all.','Process all uploaded HTML and text files with the filters before displaying them, only uploaded HTML files or none at all.',NULL,1330401579,NULL,0,0),(1773,'en_us',3,'configforcelogin','Normally, the front page of the site and the course listings (but not courses) can be read by people without logging in to the site.  If you want to force people to log in before they do ANYTHING on the site, then you should enable this setting.','Normally, the front page of the site and the course listings (but not courses) can be read by people without logging in to the site.  If you want to force people to log in before they do ANYTHING on the site, then you should enable this setting.',NULL,1330401579,NULL,0,0),(1774,'en_us',3,'configforceloginforprofiles','This setting forces people to login as a real (non-guest) account before viewing any user\'s profile. If you disabled this setting, you may find that some users post advertising (spam) or other inappropriate content in their profiles, which is then visible to the whole world.','This setting forces people to login as a real (non-guest) account before viewing any user\'s profile. If you disabled this setting, you may find that some users post advertising (spam) or other inappropriate content in their profiles, which is then visible to the whole world.',NULL,1330401579,NULL,0,0),(1775,'en_us',3,'configframename','If you are embedding Moodle within a web frame, then put the name of this frame here.  Otherwise this value should remain as \'_top\'','If you are embedding Moodle within a web frame, then put the name of this frame here.  Otherwise this value should remain as \'_top\'',NULL,1330401579,NULL,0,0),(1776,'en_us',3,'configfrontpage','The items selected above will be displayed on the site\'s front page.','The items selected above will be displayed on the site\'s front page.',NULL,1330401579,NULL,0,0),(1777,'en_us',3,'configfrontpageloggedin','The items selected above will be displayed on the site\'s front page when a user is logged in.','The items selected above will be displayed on the site\'s front page when a user is logged in.',NULL,1330401579,NULL,0,0),(1778,'en_us',3,'configfullnamedisplay','This defines how names are shown when they are displayed in full. For most mono-lingual sites the most efficient setting is the default \"First name + Surname\", but you may choose to hide surnames altogether, or to leave it up to the current language pack to decide (some languages have different conventions).','This defines how names are shown when they are displayed in full. For most mono-lingual sites the most efficient setting is the default \"First name + Surname\", but you may choose to hide surnames altogether, or to leave it up to the current language pack to decide (some languages have different conventions).',NULL,1330401579,NULL,0,0),(1779,'en_us',3,'configgdversion','Indicate the version of GD that is installed.  The version shown by default is the one that has been auto-detected.  Don\'t change this unless you really know what you\'re doing.','Indicate the version of GD that is installed.  The version shown by default is the one that has been auto-detected.  Don\'t change this unless you really know what you\'re doing.',NULL,1330401579,NULL,0,0),(1780,'en_us',3,'configgeoipfile','Location of GeoIP City binary data file. This file is not part of Moodle distribution and must be obtained separately from <a href=\"http://www.maxmind.com/\">MaxMind</a>. You can either buy a commercial version or use the free version.<br />Simply download <a href=\"http://www.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz\" >http://www.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz</a> and extract it into \"{$a}\" directory on your server.','Location of GeoIP City binary data file. This file is not part of Moodle distribution and must be obtained separately from <a href=\"http://www.maxmind.com/\">MaxMind</a>. You can either buy a commercial version or use the free version.<br />Simply download <a href=\"http://www.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz\" >http://www.maxmind.com/download/geoip/database/GeoLiteCity.dat.gz</a> and extract it into \"{$a}\" directory on your server.',NULL,1330401579,NULL,0,0),(1781,'en_us',3,'configgetremoteaddrconf','If your server is behind a reverse proxy, you can use this setting to specify which HTTP headers can be trusted to contain the remote IP address. The headers are read in order, using the first one that is available.','If your server is behind a reverse proxy, you can use this setting to specify which HTTP headers can be trusted to contain the remote IP address. The headers are read in order, using the first one that is available.',NULL,1330401579,NULL,0,0),(1782,'en_us',3,'configgooglemapkey','You need to enter a special key to use Google Maps for IP address lookup visualization. You can obtain the key free of charge at <a href=\"http://code.google.com/apis/maps/signup.html\" >http://code.google.com/apis/maps/signup.html</a>.<br />Your web site URL is: {$a}','You need to enter a special key to use Google Maps for IP address lookup visualization. You can obtain the key free of charge at <a href=\"http://code.google.com/apis/maps/signup.html\" >http://code.google.com/apis/maps/signup.html</a>.<br />Your web site URL is: {$a}',NULL,1330401579,NULL,0,0),(1783,'en_us',3,'configgradebookroles','This setting allows you to control who appears on the gradebook.  Users need to have at least one of these roles in a course to be shown in the gradebook for that course.','This setting allows you to control who appears on the gradebook.  Users need to have at least one of these roles in a course to be shown in the gradebook for that course.',NULL,1330401579,NULL,0,0),(1784,'en_us',3,'configgradeexport','Choose which gradebook export formats are your primary methods for exporting grades.  Chosen plugins will then set and use a \"last exported\" field for every grade.  For example, this might result in exported records being identified as being \"new\" or \"updated\".  If you are not sure about this then leave everything unchecked.','Choose which gradebook export formats are your primary methods for exporting grades.  Chosen plugins will then set and use a \"last exported\" field for every grade.  For example, this might result in exported records being identified as being \"new\" or \"updated\".  If you are not sure about this then leave everything unchecked.',NULL,1330401579,NULL,0,0),(1785,'en_us',3,'confighiddenuserfields','Select which user information fields you wish to hide from other users other than course teachers/admins. This will increase student privacy. Hold CTRL key to select multiple fields.','Select which user information fields you wish to hide from other users other than course teachers/admins. This will increase student privacy. Hold CTRL key to select multiple fields.',NULL,1330401579,NULL,0,0),(1786,'en_us',3,'configidnumber','This option specifies whether (a) Users are not be asked for an ID number at all, (b) Users are asked for an ID number but can leave it blank or (c) Users are asked for an ID Number and cannot leave it blank. If given the User\'s ID number is displayed in their Profile.','This option specifies whether (a) Users are not be asked for an ID number at all, (b) Users are asked for an ID number but can leave it blank or (c) Users are asked for an ID Number and cannot leave it blank. If given the User\'s ID number is displayed in their Profile.',NULL,1330401579,NULL,0,0),(1787,'en_us',3,'configintcachemax','For internal cache only. Maximum number of records to keep in the cache. Recommended value: 50. Use lower values to reduce memory usage.','For internal cache only. Maximum number of records to keep in the cache. Recommended value: 50. Use lower values to reduce memory usage.',NULL,1330401579,NULL,0,0),(1788,'en_us',3,'configintro','On this page you can specify a number of configuration variables that help make Moodle work properly on your server.  Don\'t worry too much about it - the defaults will usually work fine and you can always come back to this page later and change these settings.','On this page you can specify a number of configuration variables that help make Moodle work properly on your server.  Don\'t worry too much about it - the defaults will usually work fine and you can always come back to this page later and change these settings.',NULL,1330401579,NULL,0,0),(1789,'en_us',3,'configintroadmin','On this page you should configure your main administrator account which will have complete control over the site. Make sure you give it a secure username and password as well as a valid email address.  You can create more admin accounts later on.','On this page you should configure your main administrator account which will have complete control over the site. Make sure you give it a secure username and password as well as a valid email address.  You can create more admin accounts later on.',NULL,1330401579,NULL,0,0),(1790,'en_us',3,'configintrosite','This page allows you to configure the front page and name of this new site.  You can come back here later to change these settings any time using the Administration menus.','This page allows you to configure the front page and name of this new site.  You can come back here later to change these settings any time using the Administration menus.',NULL,1330401579,NULL,0,0),(1791,'en_us',3,'configintrotimezones','This page will search for new information about world timezones (including daylight savings time rules) and update your local database with this information.  These locations will be checked, in order: {$a} This procedure is generally very safe and can not break normal installations.  Do you wish to update your timezones now?','This page will search for new information about world timezones (including daylight savings time rules) and update your local database with this information.  These locations will be checked, in order: {$a} This procedure is generally very safe and can not break normal installations.  Do you wish to update your timezones now?',NULL,1330401579,NULL,0,0),(1792,'en_us',3,'configiplookup','When you click on an IP address (such as 34.12.222.93), such as in the logs, you are shown a map with a best guess of where that IP is located.  There are different plugins for this that you can choose from, each has benefits and disadvantages.','When you click on an IP address (such as 34.12.222.93), such as in the logs, you are shown a map with a best guess of where that IP is located.  There are different plugins for this that you can choose from, each has benefits and disadvantages.',NULL,1330401579,NULL,0,0),(1793,'en_us',3,'configjabberhost','The server to connect to to send jabber message notifications','The server to connect to to send jabber message notifications',NULL,1330401579,NULL,0,0),(1794,'en_us',3,'configjabberserver','XMPP host ID (can be left empty if the same as Jabber host)','XMPP host ID (can be left empty if the same as Jabber host)',NULL,1330401579,NULL,0,0),(1795,'en_us',3,'configjabberusername','The user name to use when connecting to the Jabber server','The user name to use when connecting to the Jabber server',NULL,1330401579,NULL,0,0),(1796,'en_us',3,'configjabberpassword','The password to use when connecting to the Jabber server','The password to use when connecting to the Jabber server',NULL,1330401579,NULL,0,0),(1797,'en_us',3,'configjabberport','The port to use when connecting to the Jabber server','The port to use when connecting to the Jabber server',NULL,1330401579,NULL,0,0),(1798,'en_us',3,'configkeeptagnamecase','Check this if you want tag names to keep the original casing as entered by users who created them','Check this if you want tag names to keep the original casing as entered by users who created them',NULL,1330401579,NULL,0,0),(1799,'en_us',3,'configlang','Choose a default language for the whole site. Users can override this setting using the language menu or the setting in their personal profile.','Choose a default language for the whole site. Users can override this setting using the language menu or the setting in their personal profile.',NULL,1330401579,NULL,0,0),(1800,'en_us',3,'configlangstringcache','Caches all the language strings into compiled files in the data directory.  If you are translating Moodle or changing strings in the Moodle source code then you may want to switch this off.  Otherwise leave it on to see performance benefits.','Caches all the language strings into compiled files in the data directory.  If you are translating Moodle or changing strings in the Moodle source code then you may want to switch this off.  Otherwise leave it on to see performance benefits.',NULL,1330401579,NULL,0,0),(1801,'en_us',3,'configlangdir','Most languages are printed left-to-right, but some, like Arabic and Hebrew, are printed right-to-left.','Most languages are printed left-to-right, but some, like Arabic and Hebrew, are printed right-to-left.',NULL,1330401579,NULL,0,0),(1802,'en_us',3,'configlanglist','Leave this blank to allow users to choose from any language you have in this installation of Moodle.  However, you can shorten the language menu by entering a comma-separated list of language codes that you want.  For example:  en,es_es,fr,it','Leave this blank to allow users to choose from any language you have in this installation of Moodle.  However, you can shorten the language menu by entering a comma-separated list of language codes that you want.  For example:  en,es_es,fr,it',NULL,1330401579,NULL,0,0),(1803,'en_us',3,'configlangmenu','Choose whether or not you want to display the general-purpose language menu on the home page, login page etc.  This does not affect the user\'s ability to set the preferred language in their own profile.','Choose whether or not you want to display the general-purpose language menu on the home page, login page etc.  This does not affect the user\'s ability to set the preferred language in their own profile.',NULL,1330401579,NULL,0,0),(1804,'en_us',3,'configlatinexcelexport','Choose the encoding for Excel exports.','Choose the encoding for Excel exports.',NULL,1330401579,NULL,0,0),(1805,'en_us',3,'configlocale','Choose a sitewide locale - this will override the format and language of dates for all language packs (though names of days in calendar are not affected). You need to have this locale data installed on your operating system (eg for linux en_US.UTF-8 or es_ES.UTF-8). In most cases this field should be left blank.','Choose a sitewide locale - this will override the format and language of dates for all language packs (though names of days in calendar are not affected). You need to have this locale data installed on your operating system (eg for linux en_US.UTF-8 or es_ES.UTF-8). In most cases this field should be left blank.',NULL,1330401579,NULL,0,0),(1806,'en_us',3,'configloginhttps','Turning this on will make Moodle use a secure https connection just for the login page (providing a secure login), and then afterwards revert back to the normal http URL for general speed.  CAUTION: this setting REQUIRES https to be specifically enabled on the web server - if it is not then YOU COULD LOCK YOURSELF OUT OF YOUR SITE.','Turning this on will make Moodle use a secure https connection just for the login page (providing a secure login), and then afterwards revert back to the normal http URL for general speed.  CAUTION: this setting REQUIRES https to be specifically enabled on the web server - if it is not then YOU COULD LOCK YOURSELF OUT OF YOUR SITE.',NULL,1330401579,NULL,0,0),(1807,'en_us',3,'configloglifetime','This specifies the length of time you want to keep logs about user activity.  Logs that are older than this age are automatically deleted.  It is best to keep logs as long as possible, in case you need them, but if you have a very busy server and are experiencing performance problems, then you may want to lower the log lifetime. Values lower than 30 are not recommended because statistics may not work properly.','This specifies the length of time you want to keep logs about user activity.  Logs that are older than this age are automatically deleted.  It is best to keep logs as long as possible, in case you need them, but if you have a very busy server and are experiencing performance problems, then you may want to lower the log lifetime. Values lower than 30 are not recommended because statistics may not work properly.',NULL,1330401579,NULL,0,0),(1808,'en_us',3,'configlookahead','Days to look ahead','Days to look ahead',NULL,1330401579,NULL,0,0),(1809,'en_us',3,'configmailnewline','Newline characters used in mail messages. CRLF is required according to RFC 822bis, some mail servers do automatic conversion from LF to CRLF, other mail servers do incorrect conversion from CRLF to CRCRLF, yet others reject mails with bare LF (qmail for example). Try changing this setting if you are having problems with undelivered emails or double newlines.','Newline characters used in mail messages. CRLF is required according to RFC 822bis, some mail servers do automatic conversion from LF to CRLF, other mail servers do incorrect conversion from CRLF to CRCRLF, yet others reject mails with bare LF (qmail for example). Try changing this setting if you are having problems with undelivered emails or double newlines.',NULL,1330401579,NULL,0,0),(1810,'en_us',3,'configmaxbytes','This specifies a maximum size that uploaded files can be throughout the whole site. This setting is limited by the PHP settings post_max_size and upload_max_filesize, as well as the Apache setting LimitRequestBody. In turn, maxbytes limits the range of sizes that can be chosen at course level or module level. If \'Server Limit\' is chosen, the server maximum allowed by the server will be used.','This specifies a maximum size that uploaded files can be throughout the whole site. This setting is limited by the PHP settings post_max_size and upload_max_filesize, as well as the Apache setting LimitRequestBody. In turn, maxbytes limits the range of sizes that can be chosen at course level or module level. If \'Server Limit\' is chosen, the server maximum allowed by the server will be used.',NULL,1330401579,NULL,0,0),(1811,'en_us',3,'configmaxconsecutiveidentchars','Passwords must not have more than this number of consecutive identical characters. Use 0 to disable this check.','Passwords must not have more than this number of consecutive identical characters. Use 0 to disable this check.',NULL,1330401579,NULL,0,0),(1812,'en_us',3,'configmaxeditingtime','This specifies the amount of time people have to re-edit forum postings, glossary comments etc.  Usually 30 minutes is a good value.','This specifies the amount of time people have to re-edit forum postings, glossary comments etc.  Usually 30 minutes is a good value.',NULL,1330401579,NULL,0,0),(1813,'en_us',3,'configmaxevents','Events to Lookahead','Events to Lookahead',NULL,1330401579,NULL,0,0),(1814,'en_us',3,'configmemcachedhosts','For memcached. Comma-separated list of hosts that are running the memcached daemon. Use IP addresses to avoid DNS latency. memcached does not behave well if you add/remove hosts on a running setup.','For memcached. Comma-separated list of hosts that are running the memcached daemon. Use IP addresses to avoid DNS latency. memcached does not behave well if you add/remove hosts on a running setup.',NULL,1330401579,NULL,0,0),(1815,'en_us',3,'configmemcachedpconn','For memcached. Use persistent connections. Use carefully -- it can make Apache/PHP crash after a restart of the memcached daemon.','For memcached. Use persistent connections. Use carefully -- it can make Apache/PHP crash after a restart of the memcached daemon.',NULL,1330401579,NULL,0,0),(1816,'en_us',3,'configmessaging','Should t