ion with /my','This setting forces redirects to /my on login for non-admins and replaces the top level site navigation with /my',NULL,1330401580,NULL,0,0),(1826,'en_us',3,'configmypagelocked','This setting prevents the default page from being edited by any non-admins','This setting prevents the default page from being edited by any non-admins',NULL,1330401580,NULL,0,0),(1827,'en_us',3,'confignavcourselimit','Limits the number of courses shown to the user when they are either not logged in or are not enrolled in any courses.','Limits the number of courses shown to the user when they are either not logged in or are not enrolled in any courses.',NULL,1330401580,NULL,0,0),(1828,'en_us',3,'confignavshowallcourses','Setting this ensures that all courses on the site are shown in the navigation at all times.','Setting this ensures that all courses on the site are shown in the navigation at all times.',NULL,1330401580,NULL,0,0),(1829,'en_us',3,'confignavshowcategories','Show course categories in the navigation bar and navigation blocks. This does not occur with courses the user is currently enrolled in, they will still be listed under mycourses without categories.','Show course categories in the navigation bar and navigation blocks. This does not occur with courses the user is currently enrolled in, they will still be listed under my courses without categories.',NULL,1330401580,NULL,0,0),(1830,'en_us',3,'confignoreplyaddress','Emails are sometimes sent out on behalf of a user (eg forum posts). The email address you specify here will be used as the \"From\" address in those cases when the recipients should not be able to reply directly to the user (eg when a user chooses to keep their address private).','Emails are sometimes sent out on behalf of a user (eg forum posts). The email address you specify here will be used as the \"From\" address in those cases when the recipients should not be able to reply directly to the user (eg when a user chooses to keep their address privat