0,0),(1835,'en_us',3,'configoverride','Defined in config.php','Defined in config.php',NULL,1330401580,NULL,0,0),(1836,'en_us',3,'configpasswordpolicy','Turning this on will make Moodle check user passwords against a valid password policy. Use the settings below to specify your policy (they will be ignored if you set this to \'No\').','Turning this on will make Moodle check user passwords against a valid password policy. Use the settings below to specify your policy (they will be ignored if you set this to \'No\').',NULL,1330401580,NULL,0,0),(1837,'en_us',3,'configpathtoclam','Path to clam AV.  Probably something like /usr/bin/clamscan or /usr/bin/clamdscan. You need this in order for clam AV to run.','Path to clam AV.  Probably something like /usr/bin/clamscan or /usr/bin/clamdscan. You need this in order for clam AV to run.',NULL,1330401580,NULL,0,0),(1838,'en_us',3,'configpathtodu','Path to du. Probably something like /usr/bin/du. If you enter this, pages that display directory contents will run much faster for directories with a lot of files.','Path to du. Probably something like /usr/bin/du. If you enter this, pages that display directory contents will run much faster for directories with a lot of files.',NULL,1330401580,NULL,0,0),(1839,'en_us',3,'configperfdebug','If you turn this on, performance info will be printed in the footer of the standard theme','If you turn this on, performance info will be printed in the footer of the standard theme',NULL,1330401580,NULL,0,0),(1840,'en_us',3,'configprofileroles','List of roles that are visible on user profiles and participation page.','List of roles that are visible on user profiles and participation page.',NULL,1330401580,NULL,0,0),(1841,'en_us',3,'configprofilesforenrolledusersonly','To prevent misuse by spammers, profile descriptions of users who are not yet enrolled in any course are hidden. New users must enrol in at least one course before they can add a profile description.','To prevent misuse by spammers, profile descriptions of users who are not yet enrolled in any course are hidden. New users must enroll in at least one course before they can add a profile description.',NULL,1330401580,NULL,0,0),(1842,'en_us',3,'configprotectusernames','By default forget_password.php does not display any hints that would allow guessing of usernames or email addresses.','By default forget_password.php does not display any hints that would allow guessing of usernames or email addresses.',NULL,1330401580,NULL,0,0),(1843,'en_us',3,'configproxybypass','Comma separated list of (partial) hostnames or IPs that should bypass proxy (e.g., 192.168., .mydomain.com)','Comma separated list of (partial) hostnames or IPs that should bypass proxy (e.g., 192.168., .mydomain.com)',NULL,1330401580,NULL,0,0),(1844,'en_us',3,'configproxyhost','If this <b>server</b> needs to use a proxy computer (eg a firewall) to access the Internet, then provide the proxy hostname here.  Otherwise leave it blank.','If this <b>server</b> needs to use a proxy computer (eg a firewall) to access the Internet, then provide the proxy hostname here.  Otherwise leave it blank.',NULL,1330401580,NULL,0,0),(1845,'en_us',3,'configproxypassword','Password needed to access internet through proxy if required, empty if none (PHP cURL extension required).','Password needed to access internet through proxy if required, empty if none (PHP cURL extension required).',NULL,1330401580,NULL,0,0),(1846,'en_us',3,'configproxyport','If this server needs to use a proxy computer, then provide the proxy port here.','If this server needs to use a proxy computer, then provide the proxy port here.',NULL,1330401580,NULL,0,0),(1847,'en_us',3,'configproxytype','Type of web proxy (PHP5 and cURL extension required for SOCKS5 support).','Type of web proxy (PHP5 and cURL extension required for SOCKS5 support).',NULL,1330401580,NULL,0,0),(1848,'en_us',3,'configproxyuser','Username needed to access internet through proxy if required, empty if none (PHP cURL extension required).','Username needed to access internet through proxy if required, empty if none (PHP cURL extension required).',NULL,1330401580,NULL,0,0),(1849,'en_us',3,'configquarantinedir','If you want clam AV to move infected files to a quarantine directory, enter it here. It must be writable by the webserver.  If you leave this blank, or if you enter a directory that doesn\'t exist or isn\'t writable, infected files will be deleted.  Do not include a trailing slash.','If you want clam AV to move infected files to a quarantine directory, enter it here. It must be writable by the webserver.  If you leave this blank, or if you enter a directory that doesn\'t exist or isn\'t writable, infected files will be deleted.  Do not include a trailing slash.',NULL,1330401580,NULL,0,0),(1850,'en_us',3,'configrcache','Use the cache to store database records. Remember to set \'cachetype\' as well!','Use the cache to store database records. Remember to set \'cachetype\' as well!',NULL,1330401580,NULL,0,0),(1851,'en_us',3,'configrcachettl','Time-to-live for cached records, in seconds. Use a short (&lt;15) value here.','Time-to-live for cached records, in seconds. Use a short (&lt;15) value here.',NULL,1330401580,NULL,0,0),(1852,'en_us',3,'configrecaptchaprivatekey','String of characters used to communicate between your Moodle server and the recaptcha server. Obtain one for this site by visiting http://www.google.com/recaptcha','String of characters used to communicate between your Moodle server and the recaptcha server. Obtain one for this site by visiting http://www.google.com/recaptcha',NULL,1330401580,NULL,0,0),(1853,'en_us',3,'configrecaptchapublickey','String of characters used to display the reCAPTCHA element in the signup form. Generated by http://www.google.com/recaptcha','String of characters used to display the reCAPTCHA element in the signup form. Generated by http://www.google.com/recaptcha',NULL,1330401580,NULL,0,0),(1854,'en_us',3,'configrequestedstudentname','Word for student used in requested courses','Word for student used in requested courses',NULL,1330401580,NULL,0,0),(1855,'en_us',3,'configrequestedstudentsname','Word for students used in requested courses','Word for students used in requested courses',NULL,1330401580,NULL,0,0),(1856,'en_us',3,'configrequestedteachername','Word for teacher used in requested courses','Word for teacher used in requested courses',NULL,1330401580,NULL,0,0),(1857,'en_us',3,'configrequestedteachersname','Word for teachers used in requested courses','Word for teachers used in requested courses',NULL,1330401580,NULL,0,0),(1858,'en_us',3,'configrequiremodintro','Disable this option if you do not want to force users to enter description of each activity.','Disable this option if you do not want to force users to enter description of each activity.',NULL,1330401580,NULL,0,0),(1859,'en_us',3,'configrestrictbydefault','Should new courses that are created that fall into the above category have their modules restricted by default?','Should new courses that are created that fall into the above category have their modules restricted by default?',NULL,1330401580,NULL,0,0),(1860,'en_us',3,'configrestrictmodulesfor','Which courses should have <b>the setting</b> for disabling some activity modules?  Note that this setting only applies to teachers, administrators will still be able to add any activity to a course.','Which courses should have <b>the setting</b> for disabling some activity modules?  Note that this setting only applies to teachers, administrators will still be able to add any activity to a course.',NULL,1330401580,NULL,0,0),(1861,'en_us',3,'configrunclamavonupload','When enabled, clam AV will be used to scan all uploaded files.','When enabled, clam AV will be used to scan all uploaded files.',NULL,1330401580,NULL,0,0),(1862,'en_us',3,'configrunclamonupload','Run clam AV on file upload? You will need a correct path in pathtoclam for this to work.  (Clam AV is a free virus scanner that you can get from http://www.clamav.net/)','Run clam AV on file upload? You will need a correct path in pathtoclam for this to work.  (Clam AV is a free virus scanner that you can get from http://www.clamav.net/)',NULL,1330401580,NULL,0,0),(1863,'en_us',3,'configuserquota','The maximum number of bytes that a user can store in their own private file area. {$a->bytes} bytes == {$a->displaysize}','The maximum number of bytes that a user can store in their own private file area. {$a->bytes} bytes == {$a->displaysize}',NULL,1330401580,NULL,0,0),(1864,'en_us',3,'configsectioninterface','Interface','Interface',NULL,1330401580,NULL,0,0),(1865,'en_us',3,'configsectionmail','Mail','Mail',NULL,1330401580,NULL,0,0),(1866,'en_us',3,'configsectionmaintenance','Maintenance','Maintenance',NULL,1330401580,NULL,0,0),(1867,'en_us',3,'configsectionmisc','Miscellaneous','Miscellaneous',NULL,1330401580,NULL,0,0),(1868,'en_us',3,'configsectionoperatingsystem','Operating system','Operating system',NULL,1330401580,NULL,0,0),(1869,'en_us',3,'configsectionpermissions','Permissions','Permissions',NULL,1330401580,NULL,0,0),(1870,'en_us',3,'configsectionrequestedcourse','Course requests','Course requests',NULL,1330401580,NULL,0,0),(1871,'en_us',3,'configsectionsecurity','Security','Security',NULL,1330401580,NULL,0,0),(1872,'en_us',3,'configsectionstats','Statistics','Statistics',NULL,1330401580,NULL,0,0),(1873,'en_us',3,'configsectionuser','User','User',NULL,1330401580,NULL,0,0),(1874,'en_us',3,'configsecureforms','Moodle can use an additional level of security when accepting data from web forms. If this is enabled, then the browser\'s HTTP_REFERER variable is checked against the current form address.  In a very few cases this can cause problems if the user is using a firewall (eg Zonealarm) configured to strip HTTP_REFERER from their web traffic.  Symptoms are getting \'stuck\' on a form. If your users are having problems with the login page (for example) you might want to disable this setting, although it might leave your site more open to brute-force password attacks.  If in doubt, leave this set to \'Yes\'.','Moodle can use an additional level of security when accepting data from web forms. If this is enabled, then the browser\'s HTTP_REFERER variable is checked against the current form address.  In a very few cases this can cause problems if the user is using a firewall (eg Zonealarm) configured to strip HTTP_REFERER from their web traffic.  Symptoms are getting \'stuck\' on a form. If your users are having problems with the login page (for example) you might want to disable this setting, although it might leave your site more open to brute-force password attacks.  If in doubt, leave this set to \'Yes\'.',NULL,1330401580,NULL,0,0),(1875,'en_us',3,'configsessioncookie','This setting customises the name of the cookie used for Moodle sessions.  This is optional, and only useful to avoid cookies being confused when there is more than one copy of Moodle running within the same web site.','This setting customises the name of the cookie used for Moodle sessions.  This is optional, and only useful to avoid cookies being confused when there is more than one copy of Moodle running within the same web site.',NULL,1330401580,NULL,0,0),(1876,'en_us',3,'configsessioncookiedomain','This allows you to change the domain that the Moodle cookies are available from. This is useful for Moodle customisations (e.g. authentication or enrolment plugins) that need to share Moodle session information with a web application on another subdomain. <strong>WARNING: it is strongly recommended to leave this setting at the default (empty) - an incorrect value will prevent all logins to the site.</strong>','This allows you to change the domain that the Moodle cookies are available from. This is useful for Moodle customizations (e.g. authentication or enrollment plugins) that need to share Moodle session information with a web application on another subdomain. <strong>WARNING: it is strongly recommended to leave this setting at the default (empty) - an incorrect value will prevent all logins to the site.</strong>',NULL,1330401580,NULL,0,0),(1877,'en_us',3,'configsessioncookiepath','If you need to change where browsers send the Moodle cookies, you can change this setting to specify a subdirectory of your web site.  Otherwise the default \'/\' should be fine.','If you need to change where browsers send the Moodle cookies, you can change this setting to specify a subdirectory of your web site.  Otherwise the default \'/\' should be fine.',NULL,1330401580,NULL,0,0),(1878,'en_us',3,'configsessiontimeout','If people logged in to this site are idle for a long time (without loading pages) then they are automatically logged out (their session is ended).  This variable specifies how long this time should be.','If people logged in to this site are idle for a long time (without loading pages) then they are automatically logged out (their session is ended).  This variable specifies how long this time should be.',NULL,1330401580,NULL,0,0),(1879,'en_us',3,'configshowcommentscount','Show comments count, it will cost one more query when display comments link','Show comments count, it will cost one more query when display comments link',NULL,1330401580,NULL,0,0),(1880,'en_us',3,'configshowsiteparticipantslist','All of these site students and site teachers will be listed on the site participants list. Who shall be allowed to see this site participants list?','All of these site students and site teachers will be listed on the site participants list. Who shall be allowed to see this site participants list?',NULL,1330401580,NULL,0,0),(1881,'en_us',3,'configsitedefaultlicense','Default site licence','Default site license',NULL,1330401580,NULL,0,0),(1882,'en_us',3,'configsitedefaultlicensehelp','The default licence for publishing content on this site','The default license for publishing content on this site',NULL,1330401580,NULL,0,0),(1883,'en_us',3,'configsitemailcharset','All the emails generated by your site will be sent in the charset specified here. Anyway, every individual user will be able to adjust it if the next setting is enabled.','All the emails generated by your site will be sent in the charset specified here. Anyway, every individual user will be able to adjust it if the next setting is enabled.',NULL,1330401580,NULL,0,0),(1884,'en_us',3,'configsitemaxcategorydepth','Maximum category depth','Maximum category depth',NULL,1330401580,NULL,0,0),(1885,'en_us',3,'configsitemaxcategorydepthhelp','This specifies the maximum depth of child categories shown','This specifies the maximum depth of child categories shown',NULL,1330401580,NULL,0,0),(1886,'en_us',3,'configslasharguments','Files (images, uploads etc) are provided via a script using \'slash arguments\'. This method allows files to be more easily cached in web browsers, proxy servers etc.  Unfortunately, some PHP servers don\'t allow this method, so if you have trouble viewing uploaded files or images (eg user pictures), disable this setting.','Files (images, uploads etc) are provided via a script using \'slash arguments\'. This method allows files to be more easily cached in web browsers, proxy servers etc.  Unfortunately, some PHP servers don\'t allow this method, so if you have trouble viewing uploaded files or images (eg user pictures), disable this setting.',NULL,1330401580,NULL,0,0),(1887,'en_us',3,'configsmartpix','With this on, icons are served through a PHP script that searches the current theme, then all parent themes, then the Moodle /pix folder. This reduces the need to duplicate image files within themes, but has a slight performance cost.','With this on, icons are served through a PHP script that searches the current theme, then all parent themes, then the Moodle /pix folder. This reduces the need to duplicate image files within themes, but has a slight performance cost.',NULL,1330401580,NULL,0,0),(1888,'en_us',3,'configsmtphosts','Give the full name of one or more local SMTP servers that Moodle should use to send mail (eg \'mail.a.com\' or \'mail.a.com;mail.b.com\'). To specify a non-default port (i.e other than port 25), you can use the [server]:[port] syntax (eg \'mail.a.com:587\'. If you leave it blank, Moodle will use the PHP default method of sending mail.','Give the full name of one or more local SMTP servers that Moodle should use to send mail (eg \'mail.a.com\' or \'mail.a.com;mail.b.com\'). To specify a non-default port (i.e other than port 25), you can use the [server]:[port] syntax (eg \'mail.a.com:587\'. If you leave it blank, Moodle will use the PHP default method of sending mail.',NULL,1330401580,NULL,0,0),(1889,'en_us',3,'configsmtpmaxbulk','Maximum number of messages sent per SMTP session. Grouping messages may speed up the sending of emails. Values lower than 2 force creation of new SMTP session for each email.','Maximum number of messages sent per SMTP session. Grouping messages may speed up the sending of emails. Values lower than 2 force creation of new SMTP session for each email.',NULL,1330401580,NULL,0,0),(1890,'en_us',3,'configsmtpuser','If you have specified an SMTP server above, and the server requires authentication, then enter the username and password here.','If you have specified an SMTP server above, and the server requires authentication, then enter the username and password here.',NULL,1330401580,NULL,0,0),(1891,'en_us',3,'configstartwday','Start of week','Start of week',NULL,1330401580,NULL,0,0),(1892,'en_us',3,'configstatsfirstrun','This specifies how far back the logs should be processed <b>the first time</b> the cronjob wants to process statistics. If you have a lot of traffic and are on shared hosting, it\'s probably not a good idea to go too far back, as it could take a long time to run and be quite resource intensive. (Note that for this setting, 1 month = 28 days. In the graphs and reports generated, 1 month = 1 calendar month.)','This specifies how far back the logs should be processed <b>the first time</b> the cronjob wants to process statistics. If you have a lot of traffic and are on shared hosting, it\'s probably not a good idea to go too far back, as it could take a long time to run and be quite resource intensive. (Note that for this setting, 1 month = 28 days. In the graphs and reports generated, 1 month = 1 calendar month.)',NULL,1330401580,NULL,0,0),(1893,'en_us',3,'configstatsmaxruntime','Stats processing can be quite intensive, so use a combination of this field and the next one to specify when it will run and how long for.','Stats processing can be quite intensive, so use a combination of this field and the next one to specify when it will run and how long for.',NULL,1330401580,NULL,0,0),(1894,'en_us',3,'configstatsmaxruntime2','Stats processing can be quite intensive, specify maximum time allowed for gathering of one day of statistics. Maximum number of days processed in one cron execution is 31.','Stats processing can be quite intensive, specify maximum time allowed for gathering of one day of statistics. Maximum number of days processed in one cron execution is 31.',NULL,1330401580,NULL,0,0),(1895,'en_us',3,'configstatsmaxruntime3','Specify the maximum time allowed to calculate the statistics for one day, bearing in mind that stats processing can put a big load on the server. The maximum number of days processed in one cron can be specified below.','Specify the maximum time allowed to calculate the statistics for one day, bearing in mind that stats processing can put a big load on the server. The maximum number of days processed in one cron can be specified below.',NULL,1330401580,NULL,0,0),(1896,'en_us',3,'configstatsruntimedays','Specify the maximum number of days processed in each stats execution. When stats are up-to-date, only one day will be processed, so adjust this value depending of your server load, reducing it if shorter cron executions are needed.','Specify the maximum number of days processed in each stats execution. When