iet period.  However, your site will continue functioning during this upgrade and users won\'t be affected.  Once you start this process you should let it finish (keep your browser window open).  However, if you stop the process by closing the window: don\'t worry, you can start over.<br /><br />Do you want to start the upgrading process now?',NULL,1330401581,NULL,0,0),(2558,'en_us',3,'upgradelogs','For full functionality, your old logs need to be upgraded.  <a href=\"{$a}\">More information</a>','For full functionality, your old logs need to be upgraded.  <a href=\"{$a}\">More information</a>',NULL,1330401581,NULL,0,0),(2559,'en_us',3,'upgradelogsinfo','Some changes have recently been made in the way logs are stored.  To be able to view all of your old logs on a per-activity basis, your old logs need to be upgraded.  Depending on your site this can take a long time (eg several hours) and can be quite taxing on the database for large sites.  Once you start this process you should let it finish (by keeping the browser window open).  Don\'t worry - your site will work fine for other people while the logs are being upgraded.<br /><br />Do you want to upgrade your logs now?','Some changes have recently been made in the way logs are stored.  To be able to view all of your old logs on a per-activity basis, your old logs need to be upgraded.  Depending on your site this can take a long time (eg several hours) and can be quite taxing on the database for large sites.  Once you start this process you should let it finish (by keeping the browser window open).  Don\'t worry - your site will work fine for other people while the logs are being upgraded.<br /><br />Do you want to upgrade your logs now?',NULL,1330401581,NULL,0,0),(2560,'en_us',3,'upgradesettings','New settings','New settings',NULL,1330401581,NULL,0,0),(2561,'en_us',3,'upgradesettingsintro','The settings shown below were added during your last Moodle upgrade. Make any changes necessary to the defaults and then click