 order of size\n* Lowest grade\n* Highest grade\n* Mode of grades - The grade that occurs the most frequently\n* Sum of grades - The sum of all grade values, with scale grades being ignored',NULL,1330401588,NULL,0,0),(5145,'en_us',29,'aggregation_link','grade/aggregation','grade/aggregation',NULL,1330401588,NULL,0,0),(5146,'en_us',29,'aggregationcoef','Aggregation coefficient','Aggregation coefficient',NULL,1330401588,NULL,0,0),(5147,'en_us',29,'aggregationcoefextra','Extra credit','Extra credit',NULL,1330401588,NULL,0,0),(5148,'en_us',29,'aggregationcoefextra_help','If the aggregation is Sum of grades or Simple weighted mean and the extra credit checkbox is ticked, the grade item\'s maximum grade is not added to the category\'s maximum grade, resulting in the possibility of achieving the maximum grade (or grades over the maximum if enabled by the site administrator) in the category without having the maximum grade in all the grade items.\n\nIf the aggregation is Mean of grades (with extra credits) and the extra credit is set to a value greater than zero, the extra credit is the factor by which the grade is multiplied before adding it to the total after the computation of the mean.','If the aggregation is Sum of grades or Simple weighted mean and the extra credit checkbox is ticked, the grade item\'s maximum grade is not added to the category\'s maximum grade, resulting in the possibility of achieving the maximum grade (or grades over the maximum if enabled by the site administrator) in the category without having the maximum grade in all the grade items.\n\nIf the aggregation is Mean of grades (with extra credits) and the extra credit is set to a value greater than zero, the extra credit is the factor by which the grade is multiplied before adding it to the total after the computation of the mean.',NULL,1330401588,NULL,0,0),(5149,'en_us',29,'aggregationcoefextra_link','grade/aggregation','grade/aggregation',NULL,1330401588,NULL,0,0),(5150,'en_us',29,'aggregationcoefextrasum','Extra credit','Extra credit',NULL,1330401588,NULL,0,0),(5151,'en_us',29,'aggregationcoefextrasum_help','If the extra credit checkbox is ticked, the grade item\'s maximum grade is not added to the category\'s maximum grade, resulting in the possibility of achieving the maximum grade (or grades over the maximum if enabled by the site administrator) in the category without having the maximum grade in all the grade items.','If the extra credit checkbox is ticked, the grade item\'s maximum grade is not added to the category\'s maximum grade, resulting in the possibility of achieving the maximum grade (or grades over the maximum if enabled by the site administrator) in the category without having the maximum grade in all the grade items.',NULL,1330401588,NULL,0,0),(5152,'en_us',29,'aggregationcoefextrasum_link','grade/aggregation','grade/aggregation',NULL,1330401588,NULL,0,0),(5153,'en_us',29,'aggregationcoefextraweight','Extra credit weight','Extra credit weight',NULL,1330401588,NULL,0,0),(5154,'en_us',29,'aggregationcoefextraweight_help','If the extra credit weight is set to a value greater than zero, the grade acts as extra credit during aggregation. The number is the factor by which the grade is multiplied before adding it to the total for the computation of the mean.','If the extra credit weight is set to a value greater than zero, the grade acts as extra credit during aggregation. The number is the factor by which the grade is multiplied before adding it to the total for the computation of the mean.',NULL,1330401588,NULL,0,0),(5155,'en_us',29,'aggregationcoefextraweight_link','grade/aggregation','grade/aggregation',NULL,1330401588,NULL,0,0),(5156,'en_us',29,'aggregationcoefweight','Item weight','Item weight',NULL,1330401588,NULL,0,0),(5157,'en_us',29,'aggregationcoefweight_help','The item weight is used in the category aggregation to influence the importance of the item compared with other grade items in the same category.','The item weight is used in th