 is called MOOCH, at hub.moodle.org.  By registering your site with MOOCH you will contribute to the statistics of the worldwide Moodle community.  You can also join a low-volume mailing list providing early notifications of security fixes and new releases of Moodle.','The main community hub is called MOOCH, at hub.moodle.org.  By registering your site with MOOCH you will contribute to the statistics of the worldwide Moodle community.  You can also join a low-volume mailing list providing early notifications of security fixes and new releases of Moodle.',NULL,1330401590,NULL,0,0),(5932,'en_us',32,'moodleorgregistrationdetail2','This option allows you to register your Moodle site with MOOCH, at hub.moodle.org.  Registration is free.\nThe main benefit of registering is that you will be added to a low-volume mailing list for important notifications such as security alerts and new releases of Moodle.\nBy default, your information will be kept private, and will never be sold or passed on to anyone else.  The only reason for collecting this information is for support purposes, and to help build up a statistical picture of the Moodle community as a whole.\nIf you choose, you can allow your site name, country and URL to be added to the public list of Moodle Sites.\nAll new registrations are verified manually before they are added to the list, but once you are added you can update your registration (and your entry on the public list) at any time.','This option allows you to register your Moodle site with MOOCH, at hub.moodle.org.  Registration is free.\nThe main benefit of registering is that you will be added to a low-volume mailing list for important notifications such as security alerts and new releases of Moodle.\nBy default, your information will be kept private, and will never be sold or passed on to anyone else.  The only reason for collecting this information is for support purposes, and to help build up a statistical picture of the Moodle community as a whole.\nIf y