0401590,NULL,0,0),(6149,'en_us',34,'dbprefix','Tables prefix','Tables prefix',NULL,1330401590,NULL,0,0),(6150,'en_us',34,'dbtype','Type','Type',NULL,1330401590,NULL,0,0),(6151,'en_us',34,'dbwrongencoding','The selected database is running under one non-recommended encoding ({$a}). It would be better to use one Unicode (UTF-8) encoded database instead. Anyway, you can bypass this test by selecting the \"Skip DB Encoding Test\" check below, but you could experience problems in the future.','The selected database is running under one non-recommended encoding ({$a}). It would be better to use one Unicode (UTF-8) encoded database instead. Anyway, you can bypass this test by selecting the \"Skip DB Encoding Test\" check below, but you could experience problems in the future.',NULL,1330401590,NULL,0,0),(6152,'en_us',34,'dbwronghostserver','You must follow \"Host\" rules as explained above.','You must follow \"Host\" rules as explained above.',NULL,1330401590,NULL,0,0),(6153,'en_us',34,'dbwrongnlslang','The NLS_LANG environment variable in your web server must use the AL32UTF8 charset. See PHP documentation about how to configure OCI8 properly.','The NLS_LANG environment variable in your web server must use the AL32UTF8 charset. See PHP documentation about how to configure OCI8 properly.',NULL,1330401590,NULL,0,0),(6154,'en_us',34,'dbwrongprefix','You must follow \"Tables Prefix\" rules as explained above.','You must follow \"Tables Prefix\" rules as explained above.',NULL,1330401590,NULL,0,0),(6155,'en_us',34,'directorysettings','<p>Please confirm the locations of this Moodle installation.</p>\n\n<p><b>Web address:</b>\nSpecify the full web address where Moodle will be accessed.  \nIf your web site is accessible via multiple URLs then choose the \nmost natural one that your students would use.  Do not include \na trailing slash.</p>\n\n<p><b>Moodle directory:</b>\nSpecify the full directory path to this installation\nMake sure the upper/lower case is correct.</p>\n\n<p><b>Data directory:</b>\nYou need a place where Moodle can save uploaded files.  This\ndirectory should be readable AND WRITEABLE by the web server user \n(usually \'nobody\' or \'apache\'), but it must not be accessible \ndirectly via the web. The installer will try to create it if doesn\'t exist.</p>','<p>Please confirm the locations of this Moodle installation.</p>\n\n<p><b>Web address:</b>\nSpecify the full web address where Moodle will be accessed.  \nIf your web site is accessible via multiple URLs then choose the \nmost natural one that your students would use.  Do not include \na trailing slash.</p>\n\n<p><b>Moodle directory:</b>\nSpecify the full directory path to this installation\nMake sure the upper/lower case is correct.</p>\n\n<p><b>Data directory:</b>\nYou need a place where Moodle can save uploaded files.  This\ndirectory should be readable AND WRITEABLE by the web server user \n(usually \'nobody\' or \'apache\'), but it must not be accessible \ndirectly via the web. The installer will try to create it if doesn\'t exist.</p>',NULL,1330401590,NULL,0,0),(6156,'en_us',34,'directorysettingshead','Please confirm the locations of this Moodle installation','Please confirm the locations of this Moodle installation',NULL,1330401590,NULL,0,0),(6157,'en_us',34,'directorysettingssub','<b>Web address:</b>\nSpecify the full web address where Moodle will be accessed.  \nIf your web site is accessible via multiple URLs then choose the \nmost natural one that your students would use.  Do not include \na trailing slash.\n<br />\n<br />\n<b>Moodle directory:</b>\nSpecify the full directory path to this installation\nMake sure the upper/lower case is correct.\n<br />\n<br />\n<b>Data directory:</b>\nYou need a place where Moodle can save uploaded files.  This\ndirectory must be readable AND WRITEABLE by the web server user \n(usually \'nobody\' or \'apache\'), but it must not be accessible \ndirectly via the web. The installer will try to create it if doesn\'t exist.','<b>Web address:</b>\nSpecify the full web address where Moodle will be accessed.  \nIf your web site is accessible via multiple URLs then choose the \nmost natural one that your students would use.  Do not include \na trailing slash.\n<br />\n<br />\n<b>Moodle directory:</b>\nSpecify the full directory path to this installation\nMake sure the upper/lower case is correct.\n<br />\n<br />\n<b>Data directory:</b>\nYou need a place where Moodle can save uploaded files.  This\ndirectory must be readable AND WRITEABLE by the web server user \n(usually \'nobody\' or \'apache\'), but it must not be accessible \ndirectly via the web. The installer will try to create it if doesn\'t exist.',NULL,1330401590,NULL,0,0),(6158,'en_us',34,'dirroot','Moodle directory','Moodle directory',NULL,1330401590,NULL,0,0),(6159,'en_us',34,'dirrooterror','The \'Moodle directory\' setting seems to be incorrect - we can\'t find a Moodle installation there. The value below has been reset.','The \'Moodle directory\' setting seems to be incorrect - we can\'t find a Moodle installation there. The value below has been reset.',NULL,1330401590,NULL,0,0),(6160,'en_us',34,'download','Download','Download',NULL,1330401590,NULL,0,0),(6161,'en_us',34,'downloadlanguagebutton','Download the &quot;{$a}&quot; language pack','Download the &quot;{$a}&quot; language pack',NULL,1330401590,NULL,0,0),(6162,'en_us',34,'downloadlanguagehead','Download language pack','Download language pack',NULL,1330401590,NULL,0,0),(6163,'en_us',34,'downloadlanguagenotneeded','You may continue the installation process using the default language pack, \"{$a}\".','You may continue the installation process using the default language pack, \"{$a}\".',NULL,1330401590,NULL,0,0),(6164,'en_us',34,'downloadlanguagesub','You now have the option of downloading a language pack and continuing the installation process in this language.<br /><br />If you are unable to download the language pack, the installation process will continue in English. (Once the installation process is complete, you will have the opportunity to download and install additional language packs.)','You now have the option of downloading a language pack and continuing the installation process in this language.<br /><br />If you are unable to download the language pack, the installation process will continue in English. (Once the installation process is complete, you will have the opportunity to download and install additional language packs.)',NULL,1330401590,NULL,0,0),(6165,'en_us',34,'doyouagree','Do you agree ? (yes/no):','Do you agree ? (yes/no):',NULL,1330401590,NULL,0,0),(6166,'en_us',34,'environmenthead','Checking your environment ...','Checking your environment ...',NULL,1330401590,NULL,0,0),(6167,'en_us',34,'environmentsub','We are checking if the various components of your system meet the system requirements','We are checking if the various components of your system meet the system requirements',NULL,1330401590,NULL,0,0),(6168,'en_us',34,'environmentsub2','Each Moodle release has some minimum PHP version requirement and a number of mandatory PHP extensions.\nFull environment check is done before each install and upgrade. Please contact server administrator if you do not know how to install new version or enable PHP extensions.','Each Moodle release has some minimum PHP version requirement and a number of mandatory PHP extensions.\nFull environment check is done before each install and upgrade. Please contact server administrator if you do not know how to install new version or enable PHP extensions.',NULL,1330401590,NULL,0,0),(6169,'en_us',34,'errorsinenvironment','Environment check failed!','Environment check failed!',NULL,1330401590,NULL,0,0),(6170,'en_us',34,'fail','Fail','Fail',NULL,1330401590,NULL,0,0),(6171,'en_us',34,'fileuploads','File uploads','File uploads',NULL,1330401590,NULL,0,0),(6172,'en_us',34,'fileuploadserror','This should be on','This should be on',NULL,1330401590,NULL,0,0),(6173,'en_us',34,'fileuploadshelp','<p>File uploading seems to be disabled on your server.</p>\n\n<p>Moodle can still be installed, but without this ability, you will not be able \n   to upload course files or new user profile images.</p>\n\n<p>To enable file uploading you (or your system administrator) will need to \n   edit the main php.ini file on your system and change the setting for \n   <b>file_uploads</b> to \'1\'.</p>','<p>File uploading seems to be disabled on your server.</p>\n\n<p>Moodle can still be installed, but without this ability, you will not be able \n   to upload course files or new user profile images.</p>\n\n<p>To enable file uploading you (or your system administrator) will need to \n   edit the main php.ini file on your system and change the setting for \n   <b>file_uploads</b> to \'1\'.</p>',NULL,1330401590,NULL,0,0),(6174,'en_us',34,'gdversion','GD version','GD version',NULL,1330401590,NULL,0,0),(6175,'en_us',34,'gdversionerror','The GD library should be present to process and create images','The GD library should be present to process and create images',NULL,1330401590,NULL,0,0),(6176,'en_us',34,'gdversionhelp','<p>Your server does not seem to have GD installed.</p>\n\n<p>GD is a library that is required by PHP to allow Moodle to process images \n   (such as the user profile icons) and to create new images (such as \n   the log graphs).  Moodle will still work without GD - these features \n   will just not be available to you.</p>\n\n<p>To add GD to PHP under Unix, compile PHP using the --with-gd parameter.</p>\n\n<p>Under Windows you can usually edit php.ini and uncomment the line referencing php_gd2.dll.</p>','<p>Your server does not seem to have GD installed.</p>\n\n<p>GD is a library that is required by PHP to allow Moodle to process images \n   (such as the user profile icons) and to create new images (such as \n   the log graphs).  Moodle will still work without GD - these features \n   will just not be available to you.</p>\n\n<p>To add GD to PHP under Unix, compile PHP using the --with-gd parameter.</p>\n\n<p>Under Windows you can usually edit php.ini and uncomment the line referencing php_gd2.dll.</p>',NULL,1330401590,NULL,0,0),(6177,'en_us',34,'globalsquotes','Insecure handling of globals','Insecure handling of globals',NULL,1330401590,NULL,0,0),(6178,'en_us',34,'globalsquoteserror','Fix your PHP settings: disable register_globals and/or enable magic_quotes_gpc','Fix your PHP settings: disable register_globals and/or enable magic_quotes_gpc',NULL,1330401590,NULL,0,0),(6179,'en_us',34,'globalsquoteshelp','<p>Combination of disabled magic quotes GPC and enabled register globals both at the same time is not recommended.</p>\n\n<p>The recommended setting is <b>magic_quotes_gpc = On</b> and <b>register_globals = Off</b> in your php.ini</p>\n\n<p>If you don\'t have access to your php.ini, you might be able to place the following line in a file\n   called .htaccess within your Moodle directory:</p>\n   <blockquote><div>php_value magic_quotes_gpc On</div></blockquote>\n   <blockquote><div>php_value register_globals Off</div></blockquote>','<p>Combination of disabled magic quotes GPC and enabled register globals both at the same time is not recommended.</p>\n\n<p>The recommended setting is <b>magic_quotes_gpc = On</b> and <b>register_globals = Off</b> in your php.ini</p>\n\n<p>If you don\'t have access to your php.ini, you might be able to place the following line in a file\n   called .htaccess within your Moodle directory:</p>\n   <blockquote><div>php_value magic_quotes_gpc On</div></blockquote>\n   <blockquote><div>php_value register_globals Off</div></blockquote>',NULL,1330401590,NULL,0,0),(6180,'en_us',34,'chooselanguage','Choose a language','Choose a language',NULL,1330401590,NULL,0,0),(6181,'en_us',34,'chooselanguagehead','Choose a language','Choose a language',NULL,1330401590,NULL,0,0),(6182,'en_us',34,'chooselanguagesub','Please choose a language for the installation. This language will also be used as the default language for the site, though it may be changed later.','Please choose a language for the installation. This language will also be used as the default language for the site, though it may be changed later.',NULL,1330401590,NULL,0,0),(6183,'en_us',34,'inputdatadirectory','Data directory:','Data directory:',NULL,1330401590,NULL,0,0),(6184,'en_us',34,'inputwebadress','Web address :','Web address :',NULL,1330401590,NULL,0,0),(6185,'en_us',34,'inputwebdirectory','Moodle directory:','Moodle directory:',NULL,1330401590,NULL,0,0),(6186,'en_us',34,'installation','Installation','Installation',NULL,1330401590,NULL,0,0),(6187,'en_us',34,'langdownloaderror','Unfortunately the language \"{$a}\" could not be downloaded. The installation process will continue in English.','Unfortunately the language \"{$a}\" could not be downloaded. The installation process will continue in English.',NULL,1330401590,NULL,0,0),(6188,'en_us',34,'langdownloadok','The language \"{$a}\" was installed successfully. The installation process will continue in this language.','The language \"{$a}\" was installed successfully. The installation process will continue in this language.',NULL,1330401590,NULL,0,0),(6189,'en_us',34,'magicquotesruntime','Magic quotes run time','Magic quotes run time',NULL,1330401590,NULL,0,0),(6190,'en_us',34,'magicquotesruntimeerror','This should be off','This should be off',NULL,1330401590,NULL,0,0),(6191,'en_us',34,'magicquotesruntimehelp','<p>Magic quotes runtime should be turned off for Moodle to function properly.</p>\n\n<p>Normally it is off by default ... see the setting <b>magic_quotes_runtime</b> in your php.ini file.</p>\n\n<p>If you don\'t have access to your php.ini, you might be able to place the following line in a file \n   called .htaccess within your Moodle directory:</p>\n   <blockquote><div>php_value magic_quotes_runtime Off</div></blockquote>','<p>Magic quotes runtime should be turned off for Moodle to function properly.</p>\n\n<p>Normally it is off by default ... see the setting <b>magic_quotes_runtime</b> in your php.ini file.</p>\n\n<p>If you don\'t have access to your php.ini, you might be able to place the following line in a file \n   called .htaccess within your Moodle directory:</p>\n   <blockquote><div>php_value magic_quotes_runtime Off</div></blockquote>',NULL,1330401590,NULL,0,0),(6192,'en_us',34,'memorylimit','Memory limit','Memory limit',NULL,1330401590,NULL,0,0),(6193,'en_us',34,'memorylimiterror','The PHP memory limit is set quite low ... you may run into problems later.','The PHP memory limit is set quite low ... you may run into problems later.',NULL,1330401590,NULL,0,0),(6194,'en_us',34,'memorylimithelp','<p>The PHP memory limit for your server is currently set to {$a}.</p>\n\n<p>This may cause Moodle to have memory problems later on, especially \n   if you have a lot of modules enabled and/or a lot of users.</p>\n\n<p>We recommend that you configure PHP with a higher limit if possible, like 40M.  \n   There are several ways of doing this that you can try:</p>\n<ol>\n<li>If you are able to, recompile PHP with <i>--enable-memory-limit</i>.  \n    This will allow Moodle to set the memory limit itself.</li>\n<li>If you have access to your php.ini file, you can change the <b>memory_limit</b> \n    setting in there to something like 40M.  If you don\'t have access you might \n    be able to ask your administrator to do this for you.</li>\n<li>On some PHP servers you can create a .htaccess file in the Moodle directory \n    containing this line:\n    <blockquote><div>php_value memory_limit 40M</div></blockquote>\n    <p>However, on some servers this will prevent <b>all</b> PHP pages from working \n    (you will see errors when you look at pages) so you\'ll have to remove the .htaccess file.</p></li>\n</ol>','<p>The PHP memory limit for your server is currently set to {$a}.</p>\n\n<p>This may cause Moodle to have memory problems later on, especially \n   if you have a lot of modules enabled and/or a lot of users.</p>\n\n<p>We recommend that you configure PHP with a higher limit if possible, like 40M.  \n   There are several ways of doing this that you can try:</p>\n<ol>\n<li>If you are able to, recompile PHP with <i>--enable-memory-limit</i>.  \n    This will allow Moodle to set the memory limit itself.</li>\n<li>If you have access to your php.ini file, you can change the <b>memory_limit</b> \n    setting in there to something like 40M.  If you don\'t have access you might \n    be able to ask your administrator to do this for you.</li>\n<li>On some PHP servers you can create a .htaccess file in the Moodle directory \n    containing this line:\n    <blockquote><div>php_value memory_limit 40M</div></blockquote>\n    <p>However, on some servers this will prevent <b>all</b> PHP pages from working \n    (you will see errors when you look at pages) so you\'ll have to remove the .htaccess file.</p></li>\n</ol>',NULL,1330401590,NULL,0,0),(6195,'en_us',34,'mssql','SQL*Server (mssql)','SQL*Server (mssql)',NULL,1330401590,NULL,0,0),(6196,'en_us',34,'mssqlextensionisnotpresentinphp','PHP has not been properly configured with the MSSQL extension so that it can communicate with SQL*Server.  Please check your php.ini file or recompile PHP.','PHP has not been properly configured with the MSSQL extension so that it can communicate with SQL*Server.  Please check your php.ini file or recompile PHP.',NULL,1330401590,NULL,0,0),(6197,'en_us',34,'mssql_n','SQL*Server with UTF-8 support (mssql_n)','SQL*Server with UTF-8 support (mssql_n)',NULL,1330401590,NULL,0,0),(6198,'en_us',34,'mysql','MySQL (mysql)','MySQL (mysql)',NULL,1330401590,NULL,0,0),(6199,'en_us',34,'mysqlextensionisnotpresentinphp','PHP has not been properly configured with the MySQL extension so that it can communicate with MySQL.  Please check your php.ini file or recompile PHP.','PHP has not been properly configured with the MySQL extension so that it can communicate with MySQL.  Please check your php.ini file or recompile PHP.',NULL,1330401590,NULL,0,0),(6200,'en_us',34,'mysqli','Improved MySQL (mysqli)','Improved MySQL (mysqli)',NULL,1330401590,NULL,0,0),(6201,'en_us',34,'mysqliextensionisnotpresentinphp','PHP has not been properly configured with the MySQLi extension so that it can communicate with MySQL.  Please check your php.ini file or recompile PHP.  MySQLi extension is not available for PHP 4.','PHP has not been properly configured with the MySQLi extension so that it can communicate with MySQL.  Please check your php.ini file or recompile PHP.  MySQLi extension is not available for PHP 4.',NULL,1330401590,NULL,0,0),(6202,'en_us',34,'nativemysqli','Improved MySQL (native/mysqli)','Improved MySQL (native/mysqli)',NULL,1330401590,NULL,0,0),(6203,'en_us',34,'nativemysqlihelp','Now you need to configure the database where most Moodle data will be stored.\nDatabase may be created if database user has needed permissions, username and password must already exist. Table prefix is optional.','Now you need to configure the database where most Moodle data will be stored.\nDatabase may be created if database user has needed permissions, username and password must already exist. Table prefix is optional.',NULL,1330401590,NULL,0,0),(6204,'en_us',34,'nativemssql','SQL*Server FreeTDS (native/mssql)','SQL*Server FreeTDS (native/mssql)',NULL,1330401590,NULL,0,0),(6205,'en_us',34,'nativemssqlhelp','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.',NULL,1330401590,NULL,0,0),(6206,'en_us',34,'nativeoci','Oracle (native/oci)','Oracle (native/oci)',NULL,1330401590,NULL,0,0),(6207,'en_us',34,'nativeocihelp','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.',NULL,1330401590,NULL,0,0),(6208,'en_us',34,'nativepgsql','PostgreSQL (native/pgsql)','PostgreSQL (native/pgsql)',NULL,1330401590,NULL,0,0),(6209,'en_us',34,'nativepgsqlhelp','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.',NULL,1330401590,NULL,0,0),(6210,'en_us',34,'ociextensionisnotpresentinphp','PHP has not been properly configured with the OCI8 extension so that it can communicate with Oracle.  Please check your php.ini file or recompile PHP.','PHP has not been properly configured with the OCI8 extension so that it can communicate with Oracle.  Please check your php.ini file or recompile PHP.',NULL,1330401590,NULL,0,0),(6211,'en_us',34,'oci8po','Oracle (oci8po)','Oracle (oci8po)',NULL,1330401590,NULL,0,0),(6212,'en_us',34,'odbcextensionisnotpresentinphp','PHP has not been properly configured with the ODBC extension so that it can communicate with SQL*Server.  Please check your php.ini file or recompile PHP.','PHP has not been properly configured with the ODBC extension so that it can communicate with SQL*Server.  Please check your php.ini file or recompile PHP.',NULL,1330401590,NULL,0,0),(6213,'en_us',34,'odbc_mssql','SQL*Server over ODBC (odbc_mssql)','SQL*Server over ODBC (odbc_mssql)',NULL,1330401590,NULL,0,0),(6214,'en_us',34,'pass','Pass','Pass',NULL,1330401590,NULL,0,0),(6215,'en_us',34,'paths','Paths','Paths',NULL,1330401590,NULL,0,0),(6216,'en_us',34,'pathserrcreatedataroot','Data directory ({$a->dataroot}) cannot be created by the installer.','Data directory ({$a->dataroot}) cannot be created by the installer.',NULL,1330401590,NULL,0,0),(6217,'en_us',34,'pathshead','Confirm paths','Confirm paths',NULL,1330401590,NULL,0,0),(6218,'en_us',34,'pathsrodataroot','Dataroot directory is not writable.','Dataroot directory is not writable.',NULL,1330401590,NULL,0,0),(6219,'en_us',34,'pathsroparentdataroot','Parent directory ({$a->parent}) is not writeable. Data directory ({$a->dataroot}) cannot be created by the installer.','Parent directory ({$a->parent}) is not writeable. Data directory ({$a->dataroot}) cannot be created by the installer.',NULL,1330401590,NULL,0,0),(6220,'en_us',34,'pathssubadmindir','A very few webhosts use /admin as a special URL for you to access a\ncontrol panel or something.  Unfortunately this conflicts with the standard location for the Moodle admin pages.  You can fix this by\nrenaming the admin directory in your installation, and putting that  new name here.  For example: <em>moodleadmin</em>. This will fix admin links in Moodle.','A very few webhosts use /admin as a special URL for you to access a\ncontrol panel or something.  Unfortunately this conflicts with the standard location for the Moodle admin pages.  You can fix this by\nrenaming the admin directory in your installation, and putting that  new name here.  For example: <em>moodleadmin</em>. This will fix admin links in Moodle.',NULL,1330401590,NULL,0,0),(6221,'en_us',34,'pathssubdataroot','You need a place where Moodle can save uploaded files. This directory should be readable AND WRITEABLE by the web server user\n(usually \'nobody\' or \'apache\'), but it must not be accessible directly via the web. The installer will try to create it if doesn\'t exist.','You need a place where Moodle can save uploaded files. This directory should be readable AND WRITEABLE by the web server user\n(usually \'nobody\' or \'apache\'), but it must not be accessible directly via the web. The installer will try to create it if doesn\'t exist.',NULL,1330401590,NULL,0,0),(6222,'en_us',34,'pathssubdirroot','Full directory path to Moodle installation.','Full directory path to Moodle installation.',NULL,1330401590,NULL,0,0),(6223,'en_us',34,'pathssubwwwroot','Full web address where Moodle will be accessed.\nIt\'s not possible to access Moodle using multiple addresses.\nIf your site has multiple public addresses you must set up permanent redirects on all of them except this one.\nIf your site is accessible both from Intranet and Internet use the public address here and set up DNS so that the Intranet users may use the public address too.\nIf the address is not correct please change the URL in your browser to restart installation with a different value.','Full web address where Moodle will be accessed.\nIt\'s not possible to access Moodle using multiple addresses.\nIf your site has multiple public addresses you must set up permanent redirects on all of them except this one.\nIf your site is accessible both from Intranet and Internet use the public address here and set up DNS so that the Intranet users may use the public address too.\nIf the address is not correct please change the URL in your browser to restart installation with a different value.',NULL,1330401590,NULL,0,0),(6224,'en_us',34,'pathsunsecuredataroot','Dataroot location is not secure','Dataroot location is not secure',NULL,1330401590,NULL,0,0),(6225,'en_us',34,'pathswrongadmindir','Admin directory does not exist','Admin directory does not exist',NULL,1330401590,NULL,0,0),(6226,'en_us',34,'pgsqlextensionisnotpresentinphp','PHP has not been properly configured with the PGSQL extension so that it can communicate with PostgreSQL.  Please check your php.ini file or recompile PHP.','PHP has not been properly configured with the PGSQL extension so that it can communicate with PostgreSQL.  Please check your php.ini file or recompile PHP.',NULL,1330401590,NULL,0,0),(6227,'en_us',34,'phpextension','{$a} PHP extension','{$a} PHP extension',NULL,1330401590,NULL,0,0),(6228,'en_us',34,'phpversion','PHP version','PHP version',NULL,1330401590,NULL,0,0),(6229,'en_us',34,'phpversionhelp','<p>Moodle requires a PHP version of at least 4.3.0 or 5.1.0 (5.0.x has a number of known problems).</p>\n<p>You are currently running version {$a}</p>\n<p>You must upgrade PHP or move to a host with a newer version of PHP!<br />\n(In case of 5.0.x you could also downgrade to 4.4.x version)</p>','<p>Moodle requires a PHP version of at least 4.3.0 or 5.1.0 (5.0.x has a number of known problems).</p>\n<p>You are currently running version {$a}</p>\n<p>You must upgrade PHP or move to a host with a newer version of PHP!<br />\n(In case of 5.0.x you could also downgrade to 4.4.x version)</p>',NULL,1330401590,NULL,0,0),(6230,'en_us',34,'postgres7','PostgreSQL (postgres7)','PostgreSQL (postgres7)',NULL,1330401590,NULL,0,0),(6231,'en_us',34,'releasenoteslink','For information about this version of Moodle, please see the release notes at {$a}','For information about this version of Moodle, please see the release notes at {$a}',NULL,1330401590,NULL,0,0),(6232,'en_us',34,'safemode','Safe mode','Safe mode',NULL,1330401590,NULL,0,0),(6233,'en_us',34,'safemodeerror','Moodle may have trouble with safe mode on','Moodle may have trouble with safe mode on',NULL,1330401590,NULL,0,0),(6234,'en_us',34,'safemodehelp','<p>Moodle may have a variety of problems with safe mode on, not least is that \n   it probably won\'t be allowed to create new files.</p>\n   \n<p>Safe mode is usually only enabled by paranoid public web hosts, so you may have \n   to just find a new web hosting company for your Moodle site.</p>\n   \n<p>You can try continuing the install if you like, but expect a few problems later on.</p>','<p>Moodle may have a variety of problems with safe mode on, not least is that \n   it probably won\'t be allowed to create new files.</p>\n   \n<p>Safe mode is usually only enabled by paranoid public web hosts, so you may have \n   to just find a new web hosting company for your Moodle site.</p>\n   \n<p>You can try continuing the install if you like, but expect a few problems later on.</p>',NULL,1330401590,NULL,0,0),(6235,'en_us',34,'sessionautostart','Session auto start','Session auto start',NULL,1330401590,NULL,0,0),(6236,'en_us',34,'sessionautostarterror','This should be off','This should be off',NULL,1330401590,NULL,0,0),(6237,'en_us',34,'sessionautostarthelp','<p>Moodle requires session support and will not function without it.</p>\n\n<p>Sessions can be enabled in the php.ini file ... look for the session.auto_start parameter.</p>','<p>Moodle requires session support and will not function without it.</p>\n\n<p>Sessions can be enabled in the php.ini file ... look for the session.auto_start parameter.</p>',NULL,1330401590,NULL,0,0),(6238,'en_us',34,'skipdbencodingtest','Skip DB encoding test','Skip DB encoding test',NULL,1330401590,NULL,0,0),(6239,'en_us',34,'nativesqlsrv','SQL*Server Microsoft (native/sqlsrv)','SQL*Server Microsoft (native/sqlsrv)',NULL,1330401590,NULL,0,0),(6240,'en_us',34,'nativesqlsrvhelp','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.','Now you need to configure the database where most Moodle data will be stored.\nThis database must already have been created and a username and password created to access it. Table prefix is mandatory.',NULL,1330401590,NULL,0,0),(6241,'en_us',34,'sqliteextensionisnotpresentinphp','PHP has not been properly configured with the SQLite extension.  Please check your php.ini file or recompile PHP.','PHP has not been properly configured with the SQLite extension.  Please check your php.ini file or recompile PHP.',NULL,1330401590,NULL,0,0),(6242,'en_us',34