40,'system','System','System',NULL,1330401592,NULL,0,0),(7082,'en_us',40,'testclient','MNet test client','MNet test client',NULL,1330401592,NULL,0,0),(7083,'en_us',40,'testtrustedhosts','Test an address','Test an address',NULL,1330401592,NULL,0,0),(7084,'en_us',40,'testtrustedhostsexplain','Enter an IP address to see if it is a trusted host.','Enter an IP address to see if it is a trusted host.',NULL,1330401592,NULL,0,0),(7085,'en_us',40,'theypublish','They publish','They publish',NULL,1330401592,NULL,0,0),(7086,'en_us',40,'theysubscribe','They subscribe','They subscribe',NULL,1330401592,NULL,0,0),(7087,'en_us',40,'transport_help','These options are reciprocal, so you can only force a remote host to use a signed SSL cert if your server also has a signed SSL cert.','These options are reciprocal, so you can only force a remote host to use a signed SSL cert if your server also has a signed SSL cert.',NULL,1330401592,NULL,0,0),(7088,'en_us',40,'trustedhosts','XML-RPC hosts','XML-RPC hosts',NULL,1330401592,NULL,0,0),(7089,'en_us',40,'trustedhostsexplain','<p>The trusted hosts mechanism allows specific machines to execute calls via XML-RPC to any part of the Moodle API. This is available for scripts to control Moodle behaviour and can be a very dangerous option to enable. If in doubt, keep it off.</p>\n<p><strong>This is not needed for any standard MNet feature!</strong> Turn it on only if you know what you are doing.</p>\n<p>To enable it, enter a list of IP addresses or networks,\none on each line. Some examples:</p>\nYour local host:<br />127.0.0.1<br />Your local host (with a network block):<br />127.0.0.1/32<br />Only the host with IP address 192.168.0.7:<br />192.168.0.7/32<br />Any host with an IP address between 192.168.0.1 and 192.168.0.255:<br />192.168.0.0/24<br />Any host whatsoever:<br />192.168.0.0/0<br />Obviously the last example is <strong>not</strong> a recommended configuration.','<p>The trusted hosts mechanism allows specific machines to execute calls via XML-RPC to any part of the Moodle API. This is available for scripts to control Moodle behavior and can be a very dangerous option to enable. If in doubt, keep it off.</p> <p><strong>This is not needed for any standard MNet feature!</strong> Turn it on only if you know what you are doing.</p> <p>To enable it, enter a list of IP addresses or networks, one on each line. Some examples:</p> Your local host:<br />127.0.0.1<br />Your local host (with a network block):<br />127.0.0.1/32<br />Only the host with IP address 192.168.0.7:<br />192.168.0.7/32<br />Any host with an IP address between 192.168.0.1 and 192.168.0.255:<br />192.168.0.0/24<br />Any host whatsoever:<br />192.168.0.0/0<br />Obviously the last example is <strong>not</strong> a recommended configuration.',NULL,1330401592,NULL,0,0),(7090,'en_us',40,'turnitoff','Turn it off','Turn it off',NULL,1330401592,NULL,0,0),(7091,'en_us',40,'turniton','Turn it on','Turn it on',NULL,1330401592,NULL,0,0),(7092,'en_us',40,'type','Type','Type',NULL,1330401592,NULL,0,0),(7093,'en_us',40,'unknown','Unknown','Unknown',NULL,1330401592,NULL,0,0),(7094,'en_us',40,'unknownerror','Unknown error occurred during negotiation.','Unknown error occurred during negotiation.',NULL,1330401592,NULL,0,0),(7095,'en_us',40,'usercannotchangepassword','You cannot change your password here since you are a remote user.','You cannot change your password here since you are a remote user.',NULL,1330401592,NULL,0,0),(7096,'en_us',40,'userchangepasswordlink','<br /> You may be able to change your password at your <a href=\"{$a->wwwroot}/login/change_password.php\">{$a->description}</a> provider.','<br /> You may be able to change your password at your <a href=\"{$a->wwwroot}/login/change_password.php\">{$a->description}</a> provider.',NULL,1330401592,NULL,0,0),(7097,'en_us',40,'usernotfullysetup','Your user account is incomplete.  You need to go <a href=\"{$a}\">back to your provider</a> and ensure your profile is completed there.  You may need to 