icular category.','Rather than keeping everything in one big list, questions may be arranged into categories and subcategories.\n\nEach category has a context which determines where the questions in the category can be used:\n\n* Activity context - Questions only available in the activity module\n* Course context - Questions available in all activity modules in the course\n* Course category context - Questions available in all activity modules and courses in the course category \n* System context - Questions available in all courses and activities on the site\n\nCategories are also used for random questions, as questions are selected from a particular category.',NULL,1330401593,NULL,0,0),(7388,'en_us',48,'editcategories_link','question/category','question/category',NULL,1330401593,NULL,0,0),(7389,'en_us',48,'editingcategory','Editing a category','Editing a category',NULL,1330401593,NULL,0,0),(7390,'en_us',48,'editingquestion','Editing a question','Editing a question',NULL,1330401593,NULL,0,0),(7391,'en_us',48,'editthiscategory','Edit this category','Edit this category',NULL,1330401593,NULL,0,0),(7392,'en_us',48,'emptyxml','Unkown error - empty imsmanifest.xml','Unkown error - empty imsmanifest.xml',NULL,1330401593,NULL,0,0),(7393,'en_us',48,'enabled','Enabled','Enabled',NULL,1330401593,NULL,0,0),(7394,'en_us',48,'erroraccessingcontext','Cannot access context','Cannot access context',NULL,1330401593,NULL,0,0),(7395,'en_us',48,'errordeletingquestionsfromcategory','Error deleting questions from category {$a}.','Error deleting questions from category {$a}.',NULL,1330401593,NULL,0,0),(7396,'en_us',48,'errorduringpost','Error occurred during post-processing!','Error occurred during post-processing!',NULL,1330401593,NULL,0,0),(7397,'en_us',48,'errorduringpre','Error occurred during pre-processing!','Error occurred during pre-processing!',NULL,1330401593,NULL,0,0),(7398,'en_us',48,'errorduringproc','Error occurred during processing!','Error occurred during processing!',NULL