 have to log in/ register before you can submit your answer.',NULL,1330401598,NULL,0,0),(8994,'en_us',63,'guestnoupload','Sorry, guests are not allowed to upload','Sorry, guests are not allowed to upload',NULL,1330401598,NULL,0,0),(8995,'en_us',63,'helpoffline','<p>This is useful when the assignment is performed outside of Moodle.  It could be\n   something elsewhere on the web or face-to-face.</p><p>Students can see a description of the assignment,\n   but can\'t upload files or anything.  Grading works normally, and students will get notifications of\n   their grades.</p>','<p>This is useful when the assignment is performed outside of Moodle.  It could be\n   something elsewhere on the web or face-to-face.</p><p>Students can see a description of the assignment,\n   but can\'t upload files or anything.  Grading works normally, and students will get notifications of\n   their grades.</p>',NULL,1330401598,NULL,0,0),(8996,'en_us',63,'helponline','<p>This assignment type asks users to edit a text, using the normal\n   editing tools.  Teachers can grade them online, and even add inline comments or changes.</p>\n   <p>(If you are familiar with older versions of Moodle, this Assignment\n   type does the same thing as the old Journal module used to do.)</p>','<p>This assignment type asks users to edit a text, using the normal\n   editing tools.  Teachers can grade them online, and even add inline comments or changes.</p>\n   <p>(If you are familiar with older versions of Moodle, this Assignment\n   type does the same thing as the old Journal module used to do.)</p>',NULL,1330401598,NULL,0,0),(8997,'en_us',63,'helpupload','<p>This type of assignment allows each participant to upload one or more files in any format.\n   These might be a Word processor documents, images, a zipped web site, or anything you ask them to submit.</p>\n   <p>This type also allows you to upload multiple response files. Response files can be also uploaded before submission which\n   can be used to give each participant different file to work with.</p>\n   <p>Participants may also enter notes describing the submitted files, progress status or any other text information.</p>\n   <p>Submission of this type of assignment must be manually finalised by the participant. You can review the current status\n   at any time, unfinished assignments are marked as Draft. You can revert any ungraded assignment back to draft status.</p>','<p>This type of assignment allows each participant to upload one or more files in any format.\n   These might be a Word processor documents, images, a zipped web site, or anything you ask them to submit.</p>\n   <p>This type also allows you to upload multiple response files. Response files can be also uploaded before submission which\n   can be used to give each participant different file to work with.</p>\n   <p>Participants may also enter notes describing the submitted files, progress status or any other text information.</p>\n   <p>Submission of this type of assignment must be manually finalised by the participant. You can review the current status\n   at any time, unfinished assignments are marked as Draft. You can revert any ungraded assignment back to draft status.</p>',NULL,1330401598,NULL,0,0),(8998,'en_us',63,'helpuploadsingle','<p>This type of assignment allows each participant to upload a\n   single file, of any type.</p> <p>This might be a Word processor document, an image,\n   a zipped web site, or anything you ask them to submit.</p>','<p>This type of assignment allows each participant to upload a\n   single file, of any type.</p> <p>This might be a Word processor document, an image,\n   a zipped web site, or anything you ask them to submit.</p>',NULL,1330401598,NULL,0,0),(8999,'en_us',63,'hideintro','Hide description before available date','Hide description before available date',NULL,1330401598,NULL,0,0),(9000,'en_us',63,'hideintro_help','If enabled, the assignment description is hidden before the \"Available from\" date. Only 