ld not log in to chat room!!','Could not log in to chat room!!',NULL,1330401598,NULL,0,0),(9092,'en_us',64,'configmethod','The ajax chat method provide an ajax based chat interface, it contacts server regularly for update. The normal chat method involves the clients regularly contacting the server for updates. It requires no configuration and works everywhere, but it can create a large load on the server with many chatters.  Using a server daemon requires shell access to Unix, but it results in a fast scalable chat environment.','The ajax chat method provide an ajax based chat interface, it contacts server regularly for update. The normal chat method involves the clients regularly contacting the server for updates. It requires no configuration and works everywhere, but it can create a large load on the server with many chatters.  Using a server daemon requires shell access to Unix, but it results in a fast scalable chat environment.',NULL,1330401598,NULL,0,0),(9093,'en_us',64,'confignormalupdatemode','Chatroom updates are normally served efficiently using the <em>Keep-Alive</em> feature of HTTP 1.1, but this is still quite heavy on the server. A more advanced method is to use the <em>Stream</em> strategy to feed updates to the users. Using <em>Stream</em> scales much better (similar to the chatd method) but may not be supported by your server.','Chatroom updates are normally served efficiently using the <em>Keep-Alive</em> feature of HTTP 1.1, but this is still quite heavy on the server. A more advanced method is to use the <em>Stream</em> strategy to feed updates to the users. Using <em>Stream</em> scales much better (similar to the chatd method) but may not be supported by your server.',NULL,1330401598,NULL,0,0),(9094,'en_us',64,'configoldping','What is the maximum time that may pass before we detect that a user has disconnected (in seconds)? This is just an upper limit, as usually disconnects are detected very quickly. Lower values will be more demanding on your server. If you are using the normal method, <strong>never</strong> set this lower than 2 * chat_refresh_room.','What is the maximum time that may pass before we detect that a user has disconnected (in seconds)? This is just an upper limit, as usually disconnects are detected very quickly. Lower values will be more demanding on your server. If you are using the normal method, <strong>never</strong> set this lower than 2 * chat_refresh_room.',NULL,1330401598,NULL,0,0),(9095,'en_us',64,'configrefreshroom','How often should the chat room itself be refreshed? (in seconds).  Setting this low will make the chat room seem quicker, but it may place a higher load on your web server when many people are chatting. If you are using <em>Stream</em> updates, you can select higher refresh frequencies -- try with 2.','How often should the chat room itself be refreshed? (in seconds).  Setting this low will make the chat room seem quicker, but it may place a higher load on your web server when many people are chatting. If you are using <em>Stream</em> updates, you can select higher refresh frequencies -- try with 2.',NULL,1330401598,NULL,0,0),(9096,'en_us',64,'configrefreshuserlist','How often should the list of users be refreshed? (in seconds)','How often should the list of users be refreshed? (in seconds)',NULL,1330401598,NULL,0,0),(9097,'en_us',64,'configserverhost','The hostname of the computer where the server daemon is','The hostname of the computer where the server daemon is',NULL,1330401598,NULL,0,0),(9098,'en_us',64,'configserverip','The numerical IP address that matches the above hostname','The numerical IP address that matches the above hostname',NULL,1330401598,NULL,0,0),(9099,'en_us',64,'configservermax','Max number of clients allowed','Max number of clients allowed',NULL,1330401598,NULL,0,0),(9100,'en_us',64,'configserverport','Port to use on the server for the daemon','Port to use on the server for the daemon',NULL,1330401598,NULL,0,0),(9101,'en_us',64,'currentchats','A