u can use it in your text to do things like insert images, play sounds or create different coloured text','The chat module contains some features to make chatting a little nicer.\n\n* Smilies - Any smiley faces (emoticons) that you can type elsewhere in Moodle can also be typed here, for example :-)\n* Links - Website addresses will be turned into links automatically\n* Emoting - You can start a line with \"/me\" or \":\" to emote, for example if your name is Kim and you type \":laughs!\" or \"/me laughs!\" then everyone will see \"Kim laughs!\"\n* Beeps - You can send a sound to other participants by clicking the \"beep\" link next to their name. A useful shortcut to beep all the people in the chat at once is to type \"beep all\".\n* HTML - If you know some HTML code, you can use it in your text to do things like insert images, play sounds or create different coloured text',NULL,1330401598,NULL,0,0),(9184,'en_us',64,'viewreport','View past chat sessions','View past chat sessions',NULL,1330401598,NULL,0,0),(9185,'en_us',65,'addmorechoices','Add more choices','Add more choices',NULL,1330401598,NULL,0,0),(9186,'en_us',65,'allowupdate','Allow choice to be updated','Allow choice to be updated',NULL,1330401598,NULL,0,0),(9187,'en_us',65,'answered','Answered','Answered',NULL,1330401598,NULL,0,0),(9188,'en_us',65,'completionsubmit','Show as complete when user makes a choice','Show as complete when user makes a choice',NULL,1330401598,NULL,0,0),(9189,'en_us',65,'displayhorizontal','Display horizontally','Display horizontally',NULL,1330401598,NULL,0,0),(9190,'en_us',65,'displaymode','Display mode','Display mode',NULL,1330401598,NULL,0,0),(9191,'en_us',65,'displayvertical','Display vertically','Display vertically',NULL,1330401598,NULL,0,0),(9192,'en_us',65,'expired','Sorry, this activity closed on {$a} and is no longer available','Sorry, this activity closed on {$a} and is no longer available',NULL,1330401598,NULL,0,0),(9193,'en_us',65,'fillinatleastoneoption','You need to pr