 then \"Downloaded package\" is a better option, since otherwise grades are not saved.\n* Downloaded package - Enables a package URL to be specified. The package will be unzipped and saved locally, and updated when the external SCORM package is updated.\n* Local IMS content repository - Enables a package to be selected from within an IMS repository',NULL,1330401607,NULL,0,0),(11875,'en_us',77,'scorm:viewreport','View reports','View reports',NULL,1330401607,NULL,0,0),(11876,'en_us',77,'scorm:viewscores','View scores','View scores',NULL,1330401607,NULL,0,0),(11877,'en_us',77,'scrollbars','Allow the window to be scrolled','Allow the window to be scrolled',NULL,1330401607,NULL,0,0),(11878,'en_us',77,'selectall','Select all','Select all',NULL,1330401607,NULL,0,0),(11879,'en_us',77,'selectnone','Deselect all','Deselect all',NULL,1330401607,NULL,0,0),(11880,'en_us',77,'show','Show','Show',NULL,1330401607,NULL,0,0),(11881,'en_us',77,'sided','To the side','To the side',NULL,1330401607,NULL,0,0),(11882,'en_us',77,'skipview','Student skip content structure page','Student skip content structure page',NULL,1330401607,NULL,0,0),(11883,'en_us',77,'skipview_help','This setting specifies whether the content structure page should ever be skipped (not displayed). If the package contains only one learning object, the content structure page can always be skipped.','This setting specifies whether the content structure page should ever be skipped (not displayed). If the package contains only one learning object, the content structure page can always be skipped.',NULL,1330401607,NULL,0,0),(11884,'en_us',77,'skipviewdesc','This preference sets the default for when to skip content structure for a page','This preference sets the default for when to skip content structure for a page',NULL,1330401607,NULL,0,0),(11885,'en_us',77,'slashargs','WARNING: slash arguments is disabled on this site and objects may not function as expected!','WARNING: slash arguments is disabled on this site and objects 