,0,0),(11919,'en_us',77,'whatgrade_help','If multiple attempts are allowed, this setting specifies whether the highest, average (mean), first or last attempt is recorded in the gradebook.\n\nHandling of Multiple Attempts\n\n* The option to start a new attempt is provided by a checkbox above the Enter button on the content structure page, so be sure you\'re providing access to that page if you want to allow more than one attempt.\n* Some scorm packages are intelligent about new attempts, many are not. What this means is that if the learner re-enters an existing attempt, if the SCORM content does not have internal logic to avoid overwriting previous attempts they can be overwritten, even though the attempt was \'completed\' or \'passed\'.\n* The settings \"Force completed\", \"Force new attempt\" and \"Lock after final attempt\" also provide further management of multiple attempts.','If multiple attempts are allowed, this setting specifies whether the highest, average (mean), first or last attempt is recorded in the gradebook.\n\nHandling of Multiple Attempts\n\n* The option to start a new attempt is provided by a checkbox above the Enter button on the content structure page, so be sure you\'re providing access to that page if you want to allow more than one attempt.\n* Some scorm packages are intelligent about new attempts, many are not. What this means is that if the learner re-enters an existing attempt, if the SCORM content does not have internal logic to avoid overwriting previous attempts they can be overwritten, even though the attempt was \'completed\' or \'passed\'.\n* The settings \"Force completed\", \"Force new attempt\" and \"Lock after final attempt\" also provide further management of multiple attempts.',NULL,1330401607,NULL,0,0),(11920,'en_us',77,'whatgradedesc','This preference sets the default attempts grading','This preference sets the default attempts grading',NULL,1330401607,NULL,0,0),(11921,'en_us',77,'width','Width','Width',NULL,1330401607,NULL,