orm.','Check this if you have activated Address Verification System (AVS) in your Authorize.Net merchant account. This demands address fields like street, state, country and zip when user fills out payment form.',NULL,1330401611,NULL,0,0),(12947,'en_us',98,'adminconfighttps','Please ensure that you have \"<a href=\"{$a->url}\">turned loginhttps ON</a>\" to use this plugin<br />in Admin >> Variables >> Security >> HTTP security.','Please ensure that you have \"<a href=\"{$a->url}\">turned loginhttps ON</a>\" to use this plugin<br />in Admin >> Variables >> Security >> HTTP security.',NULL,1330401611,NULL,0,0),(12948,'en_us',98,'adminconfighttpsgo','Go to the <a href=\"{$a->url}\">secure page</a> to configure this plugin.','Go to the <a href=\"{$a->url}\">secure page</a> to configure this plugin.',NULL,1330401611,NULL,0,0),(12949,'en_us',98,'admincronsetup','The cron.php maintenance script has not been run for at least 24 hours.<br />Cron must be enabled if you want to use scheduled-capture feature.<br /><b>Enable</b> \'Authorize.Net plugin\' and <b>setup cron</b> properly; or <b>uncheck an_review</b> again.<br />If you disable scheduled-capture, transactions will be cancelled unless you review them within 30 days.<br />Check <b>an_review</b> and enter <b>\'0\' to an_capture_day</b> field<br />if you want to <b>manually</b> accept/deny payments within 30 days.','The cron.php maintenance script has not been run for at least 24 hours.<br />Cron must be enabled if you want to use scheduled-capture feature.<br /><b>Enable</b> \'Authorize.Net plugin\' and <b>setup cron</b> properly; or <b>uncheck an_review</b> again.<br />If you disable scheduled-capture, transactions will be cancelled unless you review them within 30 days.<br />Check <b>an_review</b> and enter <b>\'0\' to an_capture_day</b> field<br />if you want to <b>manually</b> accept/deny payments within 30 days.',NULL,1330401611,NULL,0,0),(12950,'en_us',98,'anemailexpired','Expiry notification','Expiry notification'