g','Checking','Checking',NULL,1330401611,NULL,0,0),(13021,'en_us',98,'echecksavings','Savings','Savings',NULL,1330401611,NULL,0,0),(13022,'en_us',98,'enrolname','Authorize.Net payment gateway','Authorize.Net payment gateway',NULL,1330401611,NULL,0,0),(13023,'en_us',98,'expired','Expired','Expired',NULL,1330401611,NULL,0,0),(13024,'en_us',98,'haveauthcode','I have already an authorization code','I have already an authorization code',NULL,1330401611,NULL,0,0),(13025,'en_us',98,'howmuch','How much?','How much?',NULL,1330401611,NULL,0,0),(13026,'en_us',98,'httpsrequired','We are sorry to inform you that your request cannot be processed now. This site\'s configuration couldn\'t be set up correctly.<br /><br />Please don\'t enter your credit card number unless you see a yellow lock at the bottom of the browser. If the symbol appears, it means the page encrypts all data sent between client and server. So the information during the transaction between the two computers is protected, hence your credit card number cannot be captured over the internet.','We are sorry to inform you that your request cannot be processed now. This site\'s configuration couldn\'t be set up correctly.<br /><br />Please don\'t enter your credit card number unless you see a yellow lock at the bottom of the browser. If the symbol appears, it means the page encrypts all data sent between client and server. So the information during the transaction between the two computers is protected, hence your credit card number cannot be captured over the internet.',NULL,1330401611,NULL,0,0),(13027,'en_us',98,'choosemethod','If you know the enrolment key of the cource, please enter it below;<br />Otherwise you need to pay for this course.','If you know the enrollment key of the course, please enter it below; <br/> Otherwise you need to pay for this course.',NULL,1330401611,NULL,0,0),(13028,'en_us',98,'chooseone','Fill one or both of the following two fields. The password isn\'t shown.','Fill one or both of the fol