ix the permissions so that Moodle can delete the file, otherwise it might be processed repeatedly.','The text file you are using for file-based enrollments ({$a}) can not be deleted by the cron process.  This usually means the permissions are wrong on it.  Please fix the permissions so that Snap can delete the file, otherwise it might be processed repeatedly.',NULL,1330401612,NULL,0,0),(13180,'en_us',102,'filelockedmailsubject','Important error: Enrolment file','Important error: Enrollment file',NULL,1330401612,NULL,0,0),(13181,'en_us',102,'location','File location','File location',NULL,1330401612,NULL,0,0),(13182,'en_us',102,'mailadmin','Notify admin by email','Notify admin by email',NULL,1330401612,NULL,0,0),(13183,'en_us',102,'mailstudents','Notify students by email','Notify students by email',NULL,1330401612,NULL,0,0),(13184,'en_us',102,'mailteachers','Notify teachers by email','Notify teachers by email',NULL,1330401612,NULL,0,0),(13185,'en_us',102,'mapping','Flat file mapping','Flat file mapping',NULL,1330401612,NULL,0,0),(13186,'en_us',102,'pluginname','Flat file (CSV)','Flat file (CSV)',NULL,1330401612,NULL,0,0),(13187,'en_us',102,'pluginname_desc','This method will repeatedly check for and process a specially-formatted text file in the location that you specify.\nThe file is a comma separated file assumed to have four or six fields per line:\n<pre class=\"informationbox\">\n*  operation, role, idnumber(user), idnumber(course) [, starttime, endtime]\nwhere:\n*  operation        = add | del\n*  role             = student | teacher | teacheredit\n*  idnumber(user)   = idnumber in the user table NB not id\n*  idnumber(course) = idnumber in the course table NB not id\n*  starttime        = start time (in seconds since epoch) - optional\n*  endtime          = end time (in seconds since epoch) - optional\n</pre>\nIt could look something like this:\n<pre class=\"informationbox\">\n   add, student, 5, CF101\n   add, teacher, 6, CF101\n   add, teacheredit, 7, CF101\n   del, student, 8, CF101\n   del, student, 17, CF101\n   add, student, 21, CF101, 1091115000, 1091215000\n</pre>','This method will repeatedly check for and process a specially-formatted text file in the location that you specify.\nThe file is a comma separated file assumed to have four or six fields per line:\n<pre class=\"informationbox\">\n*  operation, role, idnumber(user), idnumber(course) [, starttime, endtime]\nwhere:\n*  operation        = add | del\n*  role             = student | teacher | teacheredit\n*  idnumber(user)   = idnumber in the user table NB not id\n*  idnumber(course) = idnumber in the course table NB not id\n*  starttime        = start time (in seconds since epoch) - optional\n*  endtime          = end time (in seconds since epoch) - optional\n</pre>\nIt could look something like this:\n<pre class=\"informationbox\">\n   add, student, 5, CF101\n   add, teacher, 6, CF101\n   add, teacheredit, 7, CF101\n   del, student, 8, CF101\n   del, student, 17, CF101\n   add, student, 21, CF101, 1091115000, 1091215000\n</pre>',NULL,1330401612,NULL,0,0),(13188,'en_us',103,'allowguests','This course allows guest users to enter','This course allows guest users to enter',NULL,1330401612,NULL,0,0),(13189,'en_us',103,'guest:config','Configure guest access instances','Configure guest access instances',NULL,1330401612,NULL,0,0),(13190,'en_us',103,'password','Password','Password',NULL,1330401612,NULL,0,0),(13191,'en_us',103,'password_help','A password allows guest access to the course to be restricted to only those who know the password. Guests will be required to supply the password each time they access the course.','A password allows guest access to the course to be restricted to only those who know the password. Guests will be required to supply the password each time they access the course.',NULL,1330401612,NULL,0,0),(13192,'en_us',103,'passwordinvalid','Incorrect access password, please try again','Incorrect access password, please try again',NULL,1330401612