ound in Moodle',NULL,1330401612,NULL,0,0),(13214,'en_us',104,'createnewcourses_desc','If enabled, the IMS Enterprise enrolment plugin can create new courses for any it finds in the IMS data but not in Moodle\'s database. Any newly-created courses are initially hidden.','If enabled, the IMS Enterprise enrollment plugin can create new courses for any it finds in the IMS data but not in Moodle\'s database. Any newly-created courses are initially hidden.',NULL,1330401612,NULL,0,0),(13215,'en_us',104,'createnewusers','Create user accounts for users not yet registered in Moodle','Create user accounts for users not yet registered in Moodle',NULL,1330401612,NULL,0,0),(13216,'en_us',104,'createnewusers_desc','IMS Enterprise enrolment data typically describes a set of users. If enabled, accounts can be created for any users not found in Moodle\'s database.\n\nUsers are searched for first by their \"idnumber\", and second by their Moodle username. Passwords are not imported by the IMS Enterprise plugin. The use of an authentication plugin is recommended for authenticating users.','IMS Enterprise enrollment data typically describes a set of users. If enabled, accounts can be created for any users not found in Moodle\'s database. \n\nUsers are searched for first by their \"idnumber\", and second by their Moodle username. Passwords are not imported by the IMS Enterprise plugin. The use of an authentication plugin is recommended for authenticating users.',NULL,1330401612,NULL,0,0),(13217,'en_us',104,'cronfrequency','Frequency of processing','Frequency of processing',NULL,1330401612,NULL,0,0),(13218,'en_us',104,'deleteusers','Delete user accounts when specified in IMS data','Delete user accounts when specified in IMS data',NULL,1330401612,NULL,0,0),(13219,'en_us',104,'deleteusers_desc','If enabled, IMS Enterprise enrolment data can specify the deletion of user accounts (if the \"recstatus\" flag is set to 3, which represents deletion of an account). As is standard in Moodle, the user record isn\'t actually deleted from Moodle\'s database, but a flag is set to mark the account as deleted.','If enabled, IMS Enterprise enrollment data can specify the deletion of user accounts (if the \"recstatus\" flag is set to 3, which represents deletion of an account). As is standard in Moodle, the user record isn\'t actually deleted from Moodle\'s database, but a flag is set to mark the account as deleted.',NULL,1330401612,NULL,0,0),(13220,'en_us',104,'pluginname_desc','This method will repeatedly check for and process a specially-formatted text file in the location that you specify.  The file must follow the IMS Enterprise specifications containing person, group, and membership XML elements.','This method will repeatedly check for and process a specially-formatted text file in the location that you specify.  The file must follow the IMS Enterprise specifications containing person, group, and membership XML elements.',NULL,1330401612,NULL,0,0),(13221,'en_us',104,'doitnow','perform an IMS Enterprise import right now','perform an IMS Enterprise import right now',NULL,1330401612,NULL,0,0),(13222,'en_us',104,'pluginname','IMS Enterprise file','IMS Enterprise file',NULL,1330401612,NULL,0,0),(13223,'en_us',104,'filelockedmail','The text file you are using for IMS-file-based enrolments ({$a}) can not be deleted by the cron process.  This usually means the permissions are wrong on it.  Please fix the permissions so that Moodle can delete the file, otherwise it might be processed repeatedly.','The text file you are using for IMS-file-based enrollments ({$a}) can not be deleted by the cron process.  This usually means the permissions are wrong on it.  Please fix the permissions so that Snap can delete the file, otherwise it might be processed repeatedly.',NULL,1330401612,NULL,0,0),(13224,'en_us',104,'filelockedmailsubject','Important error: Enrolment file','Important error: Enrollment file',NULL,1330401612,NULL,0,0),(13225,'en_us',104,'fixcasepersonalnames','Change personal names to Title Case','Change personal names to Title Case',NULL,1330401612,NULL,0,0),(13226,'en_us',104,'fixcaseusernames','Change usernames to lower case','Change usernames to lower case',NULL,1330401612,NULL,0,0),(13227,'en_us',104,'imsrolesdescription','The IMS Enterprise specification includes 8 distinct role types. Please choose how you want them to be assigned in Moodle, including whether any of them should be ignored.','The IMS Enterprise specification includes 8 distinct role types. Please choose how you want them to be assigned in Moodle, including whether any of them should be ignored.',NULL,1330401612,NULL,0,0),(13228,'en_us',104,'location','File location','File location',NULL,1330401612,NULL,0,0),(13229,'en_us',104,'logtolocation','Log file output location (blank for no logging)','Log file output location (blank for no logging)',NULL,1330401612,NULL,0,0),(13230,'en_us',104,'mailadmins','Notify admin by email','Notify admin by email',NULL,1330401612,NULL,0,0),(13231,'en_us',104,'mailusers','Notify users by email','Notify users by email',NULL,1330401612,NULL,0,0),(13232,'en_us',104,'miscsettings','Miscellaneous','Miscellaneous',NULL,1330401612,NULL,0,0),(13233,'en_us',104,'processphoto','Add user photo data to profile','Add user photo data to profile',NULL,1330401612,NULL,0,0),(13234,'en_us',104,'processphotowarning','Warning: Image processing is likely to add a significant burden to the server. You are recommended not to activate this option if large numbers of students are expected to be processed.','Warning: Image processing is likely to add a significant burden to the server. You are recommended not to activate this option if large numbers of students are expected to be processed.',NULL,1330401612,NULL,0,0),(13235,'en_us',104,'restricttarget','Only process data if the following target is specified','Only process data if the following target is specified',NULL,1330401612,NULL,0,0),(13236,'en_us',104,'restricttarget_desc','An IMS Enterprise data file could be intended for multiple \"targets\" - different LMSes, or different systems within a school/university. It\'s possible to specify in the Enterprise file that the data is intended for one or more named target systems, by naming them in <target> tags contained within the <properties> tag.\n\nIn general you don\'t need to worry about this. Leave the setting blank and Moodle will always process the data file, no matter whether a target is specified or not. Otherwise, fill in the exact name that will be output inside the <target> tag.','An IMS Enterprise data file could be intended for multiple \"targets\" - different LMSes, or different systems within a school/university. It\'s possible to specify in the Enterprise file that the data is intended for one or more named target systems, by naming them in <target> tags contained within the <properties> tag.\n\nIn general you don\'t need to worry about this. Leave the setting blank and Moodle will always process the data file, no matter whether a target is specified or not. Otherwise, fill in the exact name that will be output inside the <target> tag.',NULL,1330401612,NULL,0,0),(13237,'en_us',104,'sourcedidfallback','Use the &quot;sourcedid&quot; for a person\'s userid if the &quot;userid&quot; field is not found','Use the &quot;sourcedid&quot; for a person\'s userid if the &quot;userid&quot; field is not found',NULL,1330401612,NULL,0,0),(13238,'en_us',104,'sourcedidfallback_desc','In IMS data, the <sourcedid> field represents the persistent ID code for a person as used in the source system. The <userid> field is a separate field which should contain the ID code used by the user when logging in. In many cases these two codes may be the same - but not always.\n\nSome student information systems fail to output the <userid> field. If this is the case, you should enable this setting to allow for using the <sourcedid> as the Moodle user ID. Otherwise, leave this setting disabled.','In IMS data, the <sourcedid> field represents the persistent ID code for a person as used in the source system. The <userid> field is a separate field which should contain the ID code used by the user when logging in. In many cases these two codes may be the same - but not always.\n\nSome student information systems fail to output the <userid> field. If this is the case, you should enable this setting to allow for using the <sourcedid> as the Moodle user ID. Otherwise, leave this setting disabled.',NULL,1330401612,NULL,0,0),(13239,'en_us',104,'truncatecoursecodes','Truncate course codes to this length','Truncate course codes to this length',NULL,1330401612,NULL,0,0),(13240,'en_us',104,'truncatecoursecodes_desc','In some situations you may have course codes which you wish to truncate to a specified length before processing. If so, enter the number of characters in this box. Otherwise, leave the box blank and no truncation will occur.','In some situations you may have course codes which you wish to truncate to a specified length before processing. If so, enter the number of characters in this box. Otherwise, leave the box blank and no truncation will occur.',NULL,1330401612,NULL,0,0),(13241,'en_us',104,'usecapitafix','Tick this box if using &quot;Capita&quot; (their XML format is slightly wrong)','Tick this box if using &quot;Capita&quot; (their XML format is slightly wrong)',NULL,1330401612,NULL,0,0),(13242,'en_us',104,'usecapitafix_desc','The student data system produced by Capita has been found to have one slight error in its XML output. If you are using Capita you should enable this setting - otherwise leave it un-ticked.','The student data system produced by Capita has been found to have one slight error in its XML output. If you are using Capita you should enable this setting - otherwise leave it un-ticked.',NULL,1330401612,NULL,0,0),(13243,'en_us',104,'usersettings','User data options','User data options',NULL,1330401612,NULL,0,0),(13244,'en_us',104,'zeroisnotruncation','0 indicates no truncation'