emberattribute','LDAP member attribute','LDAP member attribute',NULL,1330401612,NULL,0,0),(13300,'en_us',105,'memberattribute_isdn','If the group membership contains distinguised names, you need to specify it here. If it does, you also need to configure the remaining settings of this section','If the group membership contains distinguised names, you need to specify it here. If it does, you also need to configure the remaining settings of this section',NULL,1330401612,NULL,0,0),(13301,'en_us',105,'memberattribute_isdn_key','Member attribute uses dn','Member attribute uses dn',NULL,1330401612,NULL,0,0),(13302,'en_us',105,'nested_groups','Do you want to use nested groups (groups of groups) for enrolment?','Do you want to use nested groups (groups of groups) for enrollment?',NULL,1330401612,NULL,0,0),(13303,'en_us',105,'nested_groups_key','Nested groups','Nested groups',NULL,1330401612,NULL,0,0),(13304,'en_us',105,'nested_groups_settings','Nested groups settings','Nested groups settings',NULL,1330401612,NULL,0,0),(13305,'en_us',105,'nosuchrole','No such role: \'{$a}\'\n','No such role: \'{$a}\'\n',NULL,1330401612,NULL,0,0),(13306,'en_us',105,'objectclass','objectClass used to search courses. Usually \'group\' or \'posixGroup\'','objectClass used to search courses. Usually \'group\' or \'posixGroup\'',NULL,1330401612,NULL,0,0),(13307,'en_us',105,'objectclass_key','Object class','Object class',NULL,1330401612,NULL,0,0),(13308,'en_us',105,'ok','OK!\n','OK!\n',NULL,1330401612,NULL,0,0),(13309,'en_us',105,'opt_deref','If the group membership contains distinguised names, specify how aliases are handled during search. Select one of the following values: \'No\' (LDAP_DEREF_NEVER) or \'Yes\' (LDAP_DEREF_ALWAYS)','If the group membership contains distinguised names, specify how aliases are handled during search. Select one of the following values: \'No\' (LDAP_DEREF_NEVER) or \'Yes\' (LDAP_DEREF_ALWAYS)',NULL,1330401612,NULL,0,0),(13310,'en_us',105,'opt_deref_key','Dereference aliases','Dereference aliases',NULL,1330401612,NULL,0,0),(13311,'en_us',105,'phpldap_noextension','<em>The PHP LDAP module does not seem to be present. Please ensure it is installed and enabled if you want to use this enrolment plugin.</em>','<em>The PHP LDAP module does not seem to be present. Please ensure it is installed and enabled if you want to use this enrollment plugin.</em>\n',NULL,1330401612,NULL,0,0),(13312,'en_us',105,'pluginname','LDAP enrolments','LDAP enrollments',NULL,1330401612,NULL,0,0),(13313,'en_us',105,'pluginname_desc','<p>You can use an LDAP server to control your enrolments. It is assumed your LDAP tree contains groups that map to the courses, and that each of those groups/courses will have membership entries to map to students.</p><p>It is assumed that courses are defined as groups in LDAP, with each group having multiple membership fields (<em>member</em> or <em>memberUid</em>) that contain a uniqueidentification of the user.</p><p>To use LDAP enrolment, your users <strong>must</strong> to have a valid  idnumber field. The LDAP groups must have that idnumber in the member fields for a user to be enrolled in the course. This will usually work well if you are already using LDAP Authentication.</p><p>Enrolments will be updated when the user logs in. You can also run a script to keep enrolments in synch. Look in <em>enrol/ldap/cli/sync.php</em>.</p><p>This plugin can also be set to automatically create new courses when new groups appear in LDAP.</p>','<p>You can use an LDAP server to control your enrollments. It is assumed your LDAP tree contains groups that map to the courses, and that each of those groups/courses will have membership entries to map to students.</p><p>It is assumed that courses are defined as groups in LDAP, with each group having multiple membership fields (<em>member</em> or <em>memberUid</em>) that contain a unique identification of the user.</p><p>To use LDAP enrollment, your users <strong>must</strong> to have a valid idnumber field. The LDAP groups must have that idnumber in the member fields for a user to be enrolled in the course. This will usually work well if you are already using LDAP Authentication.</p><p>Enrollments will be updated when the user logs in. You can also run a script to keep enrollments in synch. Look in <em>enrol/ldap/cli/sync.php</em>.</p><p>This plugin can also be set to automatically create new courses when new groups appear in LDAP.</p>',NULL,1330401612,NULL,0,0),(13314,'en_us',105,'pluginnotenabled','Plugin not enabled!','Plugin not enabled!',NULL,1330401612,NULL,0,0),(13315,'en_us',105,'role_mapping','<p>For each rol that you want to assign from LDAP, you need to specify the list of contexts where the role courses\'s groups are located. Separate different contexts with \';\'.</p><p>You also need to specify the attribute your LDAP server uses to hold the members of a group. Usually \'member\' or \'memberUid\'</p>','<p>For each rol that you want to assign from LDAP, you need to specify the list of contexts where the role courses\'s groups are located. Separate different contexts with \';\'.</p><p>You also need to specify the attribute your LDAP server uses to hold the members of a group. Usually \'member\' or \'memberUid\'</p>',NULL,1330401612,NULL,0,0),(13316,'en_us',105,'role_mapping_key','Map roles from LDAP ','Map roles from LDAP ',NULL,1330401612,NULL,0,0),(13317,'en_us',105,'roles','Role mapping','Role mapping',NULL,1330401612,NULL,0,0),(13318,'en_us',105,'server_settings','LDAP server settings','LDAP server settings',NULL,1330401612,NULL,0,0),(13319,'en_us',105,'synccourserole','== Synching course \'{$a->idnumber}\' for role \'{$a->role_shortname}\'\n','== Synching course \'{$a->idnumber}\' for role \'{$a->role_shortname}\'\n',NULL,1330401612,NULL,0,0),(13320,'en_us',105,'template','Optional: auto-created courses can copy their settings from a template course','Optional: auto-created courses can copy their settings from a template course',NULL,13304016