ith # (ex: http://example.org/video.m4v#http://example.org/video.acc#http://example.org/video.ogv#d=640x480), QuickTime player is used as a fallback for old browsers.','Video files with extension *.webm, *.m4v, *.ogv, *.mp4 and others. It is compatible with latest web browsers only, unfortunately there is no format that is supported by all browsers.\nWorkaround is to specify fallbacks sources separated with # (ex: http://example.org/video.m4v#http://example.org/video.acc#http://example.org/video.ogv#d=640x480), QuickTime player is used as a fallback for old browsers.',NULL,1330401615,NULL,0,0),(13904,'en_us',158,'mp3audio','MP3 audio','MP3 audio',NULL,1330401615,NULL,0,0),(13905,'en_us',158,'mp3audio_help','Files with extension *.mp3. Plays audio using Flowplayer, requires Flash plugin.','Files with extension *.mp3. Plays audio using Flowplayer, requires Flash plugin.',NULL,1330401615,NULL,0,0),(13906,'en_us',158,'legacyquicktime','QuickTime player','QuickTime player',NULL,1330401615,NULL,0,0),(13907,'en_us',158,'legacyquicktime_help','Files with extension *.mov, *.mp4, *.m4a, *.mp4 and *.mpg. Requires QuickTime player or codecs.','Files with extension *.mov, *.mp4, *.m4a, *.mp4 and *.mpg. Requires QuickTime player or codecs.',NULL,1330401615,NULL,0,0),(13908,'en_us',158,'legacyreal','Real media player','Real media player',NULL,1330401615,NULL,0,0),(13909,'en_us',158,'legacyreal_help','Files with extension *.rm, *.ra, *.ram, *.rp, *.rv. Requires RealPlayer.','Files with extension *.rm, *.ra, *.ram, *.rp, *.rv. Requires RealPlayer.',NULL,1330401615,NULL,0,0),(13910,'en_us',158,'legacywmp','Windows media player','Windows media player',NULL,1330401615,NULL,0,0),(13911,'en_us',158,'legacywmp_help','Files with extension *.avi and *.wmv. Fully compatible with Internet Explorer in Windows, may be problematic in other browsers or operating systems.','Files with extension *.avi and *.wmv. Fully compatible with Internet Explorer in Windows, may be problematic in other browser