us',242,'numericalmultiplier_help','The multiplier is the factor by which the correct numerical response will be multiplied.\n\nThe first unit (Unit 1) has a default multiplier of 1. Thus if the correct numerical response is 5500 and you set W as unit at Unit 1 which has 1 as default multiplier, the correct response is 5500 W.\n\nIf you add the unit kW with a multiplier of 0.001, this will add a correct response of 5.5 kW. This means that the answers 5500W or 5.5kW would be marked correct.\n\nNote that the accepted error is also multiplied, so an allowed error of 100W would become an error of 0.1kW.','The multiplier is the factor by which the correct numerical response will be multiplied.\n\nThe first unit (Unit 1) has a default multiplier of 1. Thus if the correct numerical response is 5500 and you set W as unit at Unit 1 which has 1 as default multiplier, the correct response is 5500 W.\n\nIf you add the unit kW with a multiplier of 0.001, this will add a correct response of 5.5 kW. This means that the answers 5500W or 5.5kW would be marked correct.\n\nNote that the accepted error is also multiplied, so an allowed error of 100W would become an error of 0.1kW.',NULL,1330401622,NULL,0,0),(15528,'en_us',242,'manynumerical','Only the NUMERICAL ANSWER will be graded using optional units ','Only the NUMERICAL ANSWER will be graded using optional units ',NULL,1330401622,NULL,0,0),(15529,'en_us',242,'onlynumerical','Only the NUMERICAL ANSWER will be graded, no units allowed','Only the NUMERICAL ANSWER will be graded, no units allowed',NULL,1330401622,NULL,0,0),(15530,'en_us',242,'oneunitshown','Only the NUMERICAL ANSWER will be graded, Unit1 will be shown','Only the NUMERICAL ANSWER will be graded, Unit1 will be shown',NULL,1330401622,NULL,0,0),(15531,'en_us',242,'rightexample','RIGHT as 1.00cm','RIGHT as 1.00cm',NULL,1330401622,NULL,0,0),(15532,'en_us',242,'selectunits','Select units','Select units',NULL,1330401622,NULL,0,0),(15533,'en_us',242,'selectunit','Select one un