//docs.moodle.org/en/Theme\">MoodleDocs</a>.</p><h2>Credits</h2><p>This theme was originally designed for Moodle 1.9 by Patrick Malley. It was then coded for 2.0 and is maintained by Sam Hemelryk at Moodle HQ. He can be contacted at sam@moodle.com.</p><h2>License</h2><p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>.</div></div>','	\n<div class=\"clearfix\"><div class=\"theme_screenshot\"><h2>Anomaly</h2><img src=\"anomaly/pix/screenshot.jpg\" /><h3>Theme Discussion Forum:</h3><p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p><h3>Theme Credits</h3><p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p><h3>Theme Documentation:</h3><p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p><h3>Report a bug:</h3><p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p></div><div class=\"theme_description\"><h2>About</h2><p>Anomaly is a fluid-width, three-column Moodle 2.0 theme with rounded corners. <h2>Tweaks</h2><p>This theme is built upon the Base theme inside the Moodle core. If you want to modify this theme, we recommend that you first duplicate it, then rename it before making your changes. This will prevent your customized theme from being overwritten by future Moodle upgrades, and you\'ll still have the original files if you make a mess. More information on modifying themes can be found in the <a href=\"http://docs.moodle.org/en/Theme\">MoodleDocs</a>.</p><h2>Credits</h2><p>This theme was originally designed for Moodle 1.9 by Patrick Malley. It was then coded for 2.0 and is maintained by Sam Hemelryk at Moodle HQ. He can be contacted at sam@moodle.com.</p><h2>License</h2><p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>.</div></div>',NULL,1330401623,NULL,0,0),(15637,'en_us',260,'pluginname','Arialist','Arialist',NULL,1330401623,NULL,0,0),(15638,'en_us',260,'region-side-post','Right','Right',NULL,1330401623,NULL,0,0),(15639,'en_us',260,'region-side-pre','Left','Left',NULL,1330401623,NULL,0,0),(15640,'en_us',260,'choosereadme','\n<div class=\"clearfix\">\n	<div class=\"theme_screenshot\">\n\n		<h2>Arialist</h2>\n		<img src=\"arialist/pix/screenshot.png\" />\n\n		<h3>Theme Discussion Forum:</h3>\n		<p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p>\n\n		<h3>Theme Credits</h3>\n		<p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p>\n\n		<h3>Theme Documentation:</h3>\n		<p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p>\n\n		<h3>Report a bug:</h3>\n		<p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p>\n	</div>\n\n	<div class=\"theme_description\">\n\n		<h2>About</h2>\n		<p>Arialist is a very clean and simple two-column, fluid-width theme for Moodle 2.0.</p>\n\n		<h2>Tweaks</h2>\n		<p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you want to modify this theme, we recommend that you first duplicate it, then rename it before making your changes. This will prevent your customized theme from being overwritten by future Moodle upgrades, and you\'ll still have the original files if you make a mess. More information on modifying themes can be found in the <a href=\"http://docs.moodle.org/en/Theme\">MoodleDocs</a>.</p>\n\n	<h2>Credits</h2>\n	<p>This theme was coded and is maintained by Patrick Malley of NewSchool Learning. He can be contacted by email at contact@newschoollearning.com. </p>\n\n		<h2>License</h2>\n		<p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>.\n	</div>\n</div>','<div class=\"clearfix\"> <div class=\"theme_screenshot\"> <h2>Arialist</h2> <img src=\"arialist/pix/screenshot.png\" /> <h3>Theme Discussion Forum:</h3> <p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p> <h3>Theme Credits</h3> <p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p> <h3>Theme Documentation:</h3> <p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p> <h3>Report a bug:</h3> <p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p> </div> <div class=\"theme_description\"> <h2>About</h2> <p>Arialist is a very clean and simple two-column, fluid-width theme for Moodle 2.0.</p> <h2>Tweaks</h2> <p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you want to modify this theme, we recommend that you first duplicate it, then rename it before making your changes. This will prevent your customized theme from being overwritten by future Moodle upgrades, and you\'ll still have the original files if you make a mess. More information on modifying themes can be found in the <a href=\"http://docs.moodle.org/en/Theme\">MoodleDocs</a>.</p> <h2>Credits</h2> <p>This theme was coded and is maintained by Patrick Malley of NewSchool Learning. He can be contacted by email at contact@newschoollearning.com. </p> <h2>License</h2> <p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>. </div> </div>',NULL,1330401623,NULL,0,0),(15641,'en_us',260,'linkcolor','Link color','Link color',NULL,1330401623,NULL,0,0),(15642,'en_us',260,'linkcolordesc','This sets the link color for the theme.','This sets the link color for the theme.',NULL,1330401623,NULL,0,0),(15643,'en_us',260,'configtitle','Arialist settings','Arialist settings',NULL,13304016