cker.moodle.org\">http://tracker.moodle.org</a></p> </div> <div class=\"theme_description\"> <h2>About</h2> <p>Formal White is a fluid-width, three-column theme ported over to 2.0 from Moodle 1.X.</p> <h2>Tweaks</h2> <p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you want to modify this theme, we recommend that you first duplicate it, then rename it before making your changes. This will prevent your customized theme from being overwritten by future Moodle upgrades, and you\'ll still have the original files if you make a mess. More information on modifying themes can be found in the <a href=\"http://docs.moodle.org/en/Theme\">MoodleDocs</a>.</p> <h2>Credits</h2> <p>This theme was coded and is maintained by MediaTouch 2000. </p> <h2>License</h2> <p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>. </div> </div>',NULL,1330401623,NULL,0,0),(15690,'en_us',266,'configtitle','Formal white theme','Formal white theme',NULL,1330401623,NULL,0,0),(15691,'en_us',266,'customcss','Custom CSS','Custom CSS',NULL,1330401623,NULL,0,0),(15692,'en_us',266,'customcssdesc','Any CSS you enter here will be added to every page allowing your to easily customise this theme.','Any CSS you enter here will be added to every page allowing your to easily customise this theme.',NULL,1330401623,NULL,0,0),(15693,'en_us',266,'displaylogo','Pages header content','Pages header content',NULL,1330401623,NULL,0,0),(15694,'en_us',266,'displaylogodesc','Choose whether display moodle logo or page heading text in the header.','Choose whether display moodle logo or page heading text in the header.',NULL,1330401623,NULL,0,0),(15695,'en_us',266,'fontsizereference','Font size reference','Font size reference',NULL,1330401623,NULL,0,0),(15696,'en_us',266,'fontsizereferencedesc','This allows you to set the default font size for this theme. It is not recommen