Themes\">http://docs.moodle.org/en/Themes</a></p><h3>Report a bug:</h3><p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p></div><div class=\"theme_description\"><h2>About</h2><p>FormFactor is a fluid-width, three-column theme for Moodle 2.0 that was created by Patrick Malley.<h2>Tweaks</h2><p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you want to modify this theme, we recommend that you first duplicate it then rename it before making your changes. This will prevent your customized theme from being overwritten by future Moodle upgrades, and you\'ll still have the original files if you make a mess. More information on modifying themes can be found in the <a href=\"http://docs.moodle.org/en/Theme\">MoodleDocs</a>.</p><h2>Credits</h2>	<p>This theme was coded and is maintained by Patrick Malley of NewSchool Learning. He can be contacted by email at contact@newschoollearning.com. </p><h2>License</h2><p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>.</div></div>','	\n<div class=\"clearfix\"><div class=\"theme_screenshot\"><h2>FormFactor</h2><img src=\"formfactor/pix/screenshot.jpg\" /><h3>Theme Discussion Forum:</h3><p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p><h3>Theme Credits</h3><p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p><h3>Theme Documentation:</h3><p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p><h3>Report a bug:</h3><p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p></div><div class=\"theme_description\"><h2>About</h2><p>FormFactor is a fluid-width, three-column theme for Moodle 2.0 that was created by Patrick Malley.<h2>Tweaks</h2><p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you want to modify this theme, we recommend that you first duplicate it then rename it before making your changes. This will prevent your customized theme from being overwritten by future Moodle upgrades, and you\'ll still have the original files if you make a mess. More information on modifying themes can be found in the <a href=\"http://docs.moodle.org/en/Theme\">MoodleDocs</a>.</p><h2>Credits</h2> <p>This theme was coded and is maintained by Patrick Malley of NewSchool Learning. He can be contacted by email at contact@newschoollearning.com. </p><h2>License</h2><p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>.</div></div>',NULL,1330401623,NULL,0,0),(15718,'en_us',268,'pluginname','Fusion','Fusion',NULL,1330401623,NULL,0,0),(15719,'en_us',268,'region-side-post','Right','Right',NULL,1330401623,NULL,0,0),(15720,'en_us',268,'region-side-pre','Left','Left',NULL,1330401623,NULL,0,0),(15721,'en_us',268,'choosereadme','\n<div class=\"clearfix\">\n	<div class=\"theme_screenshot\">\n\n		<h2>Fusion</h2>\n		<img src=\"fusion/pix/screenshot.jpg\" />\n\n		<h3>Theme Discussion Forum:</h3>\n		<p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p>\n\n		<h3>Theme Credits</h3>\n		<p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p>\n\n		<h3>Theme Documentation:</h3>\n		<p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p><h3>Report a bug:</h3><p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p>\n	</div>\n\n	<div class=\"theme_description\">\n\n		<h2>About</h2>\n		<p>Fusion is a two-column, fluid-width theme coded for Moodle 2.0. It makes use of custom menus that appear above the site title on every page. It also includes a basic settings page allowing you to change link color, add a tagline above the site name on the front page, and add text to the footer.</p>\n\n		<h2>Parents</h2>\n		<p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you wish to modify aspects of this theme beyond the settings offered, we advise creating a new  theme using this theme, Base and Canvas all as parents so updates to any of those themes in the core will find their way into your new theme.</p>\n\n		<h2>Credits</h2>\n		<p>This design was originally created by Digital Nature (hello@digitalnature.ro) before being ported to Moodle by Patrick Malley (patrick@newschoollearning.com).\n		<h2>License</h2>\n		<p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>.\n	</div>\n</div>','<div class=\"clearfix\"> <div class=\"theme_screenshot\"> <h2>Fusion</h2> <img src=\"fusion/pix/screenshot.jpg\" /> <h3>Theme Discussion Forum:</h3> <p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p> <h3>Theme Credits</h3> <p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p> <h3>Theme Documentation:</h3> <p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p><h3>Report a bug:</h3><p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p> </div> <div class=\"theme_description\"> <h2>About</h2> <p>Fusion is a two-column, fluid-width theme coded for Moodle 2.0. It makes use of custom menus that appear above the site title on every page. It also includes a basic settings page allowing you to change link color, add a tagline above the site name on the front page, and add text to the footer.</p> <h2>Parents</h2> <p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you wish to modify aspects of this theme beyond the settings offered, we advise creating a new theme using this theme, Base and Canvas all as parents so updates to any of those themes in the core will find their way into your new theme.</p> <h2>Credits</h2> <p>This design was originally created by Digital Nature (hello@digitalnature.ro) before being ported to Moodle by Patrick Malley (patrick@newschoollearning.com). <h2>License</h2> <p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>. </div> </div>',NULL,1330401623,NULL,0,0),(15722,'en_us',268,'linkcolor','Link color','Link color',NULL,1330401623,NULL,0,0),(15723,'en_us',268,'linkcolordesc','This sets the link color for the theme.','This sets the link color for the theme.',NULL,1330401623,NULL,0,0),(15724,'en_us',268,'configtitle','Fusion settings','Fusion settings',NULL,1330401623,NULL,0,0),(15725,'en_us',268,'customcss','Custom CSS','Custom CSS',NULL,1330401623,NULL,0,0),(15726,'en_us',268,'customcssdesc','Any CSS you enter here will be added to every page allowing your to easily customise this theme.','Any CSS you enter here will be added to every page allowing your to easily customise this theme.',NULL,1330401623,NULL,0,0),(15727,'en_us',268,'tagline','Tagline','Tagline',NULL,1330401623,NULL,0,0),(15728,'en_us',268,'taglinedesc','A short tagline to be displayed under the site name on the front page.<br />','A short tagline to be displayed under the site name on the front page.<br />',NULL,1330401623,NULL,0,0),(15729,'en_us',268,'footertext','Footertext','Footertext',NULL,1330401623,NULL,0,0),(15730,'en_us',268,'footertextdesc','Set a footnote or footer text.','Set a footnote or footer text.',NULL,1330401623,NULL,0,0),(15731,'en_us',269,'pluginname','Leatherbound','Leatherbound',NULL,1330401624,NULL,0,0),(15732,'en_us',269,'region-side-post','Right','Right',NULL,1330401624,NULL,0,0),(15733,'en_us',269,'region-side-pre','Left','Left',NULL,1330401624,NULL,0,0),(15734,'en_us',269,'choosereadme'