se</a>.\n	</div>\n</div>','<div class=\"clearfix\"> <div class=\"theme_screenshot\"> <h2>Nimble</h2> <img src=\"nimble/pix/screenshot.png\" /> <h3>Theme Discussion Forum:</h3> <p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p> <h3>Theme Credits</h3> <p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p> <h3>Theme Documentation:</h3> <p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p><h3>Report a bug:</h3><p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p> </div> <div class=\"theme_description\"> <h2>About</h2> <p>Nimble is a two-column, fluid-width theme coded for Moodle 2.0. It makes use of custom menus that appear above the site title on every page. It also includes a basic settings page allowing you to change link color, add a tagline next the site name on the front page, and add text to the footer.</p> <h2>Parents</h2> <p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you wish to modify aspects of this theme beyond the settings offered, we advise creating a new theme using this theme, Base and Canvas all as parents so updates to any of those themes in the core will find their way into your new theme.</p> <h2>Credits</h2> <p>This design was created for Moodle by Patrick Malley (patrick@newschoollearning.com) with help from John Stabinger (john@newschoollearning.com). <h2>License</h2> <p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>. </div>',NULL,1330401624,NULL,0,0),(15762,'en_us',271,'tagline','Tagline','Tagline',NULL,1330401624,NULL,0,0),(15763,'en_us',271,'taglinedesc','Set a tagline to appear under the site name on the front page.','Set a tagline to appear under the site name on the front page.',NULL,1330401624,NULL,0,0),(15764,'en_us',