 three-column, fluid-width theme for Moodle. It\'s nontraditional in the sense that it uses a fresh three-column layout that displays the content to the left of both block columns.<h2>Tweaks</h2><p>This theme is built upon both Base and Canvas, two parent themes included in the Moodle core. If you want to modify this theme, we recommend that you first duplicate it, then rename it before making your changes. This will prevent your customized theme from being overwritten by future Moodle upgrades, and you\'ll still have the original files if you make a mess. More information on modifying themes can be found in the <a href=\"http://docs.moodle.org/en/Theme\">MoodleDocs</a>.</p><h2>Credits</h2>	<p>This theme was coded and is maintained by Patrick Malley of NewSchool Learning. He can be contacted by email at contact@newschoollearning.com. </p><h2>License</h2><p>This, and all other themes included in the Moodle core, are licensed under the <a href=\"http://www.gnu.org/licenses/gpl.html\">GNU General Public License</a>.</div></div>','	\n<div class=\"clearfix\"><div class=\"theme_screenshot\"><h2>Nonzero</h2><img src=\"nonzero/pix/screenshot.jpg\" /><h3>Theme Discussion Forum:</h3><p><a href=\"http://moodle.org/mod/forum/view.php?id=46\">http://moodle.org/mod/forum/view.php?id=46</a></p><h3>Theme Credits</h3><p><a href=\"http://docs.moodle.org/en/Theme_credits\">http://docs.moodle.org/en/Theme_credits</a></p><h3>Theme Documentation:</h3><p><a href=\"http://docs.moodle.org/en/Themes\">http://docs.moodle.org/en/Themes</a></p><h3>Report a bug:</h3><p><a href=\"http://tracker.moodle.org\">http://tracker.moodle.org</a></p></div><div class=\"theme_description\"><h2>About</h2><p>Nonzero is a nontraditional, three-column, fluid-width theme for Moodle. It\'s nontraditional in the sense that it uses a fresh three-column layout that displays the content to the left of both block columns.<h2>Tweaks</h2><p>This theme is built upon both Base and Canvas, two parent themes included in the 