pecifically to work on IE6 and other old browsers.\n\nThe Moodle 2.0 release notes state that IE6 is no longer supported however we have not gone out of our way to ensure it does not work and as such it should in the most part work fine barring numerous minor visual issues.\n\nThis theme is here so that those who are stuck with IE6 can still have a usable theme, although specific areas of Moodle may still cause problems or fail to function correctly.\nIt differs from the standard theme only by the layouts, rather than using the floating div layout that puts the content first this theme uses a table for layout much like the theme\'s in Moodle 1.9.\n\nBecause IE6 is not supported Moodle HQ will not be spending copious amounts of time on getting it 100% functional. Please if you find a bug with IE6 and this theme - find a solution as well. Then create a bug report at tracker.moodle.org and provide both a detailed example of where to find and how to replicate the bug as well as the solution you found. This way we can continue to improve the theme and it\'s IE6 support.','This theme is designed specifically to work on IE6 and other old browsers.\n\nThe Moodle 2.0 release notes state that IE6 is no longer supported however we have not gone out of our way to ensure it does not work and as such it should in the most part work fine barring numerous minor visual issues.\n\nThis theme is here so that those who are stuck with IE6 can still have a usable theme, although specific areas of Moodle may still cause problems or fail to function correctly.\nIt differs from the standard theme only by the layouts, rather than using the floating div layout that puts the content first this theme uses a table for layout much like the theme\'s in Moodle 1.9.\n\nBecause IE6 is not supported Moodle HQ will not be spending copious amounts of time on getting it 100% functional. Please if you find a bug with IE6 and this theme - find a solution as well. Then create a bug report at tracker.moodle.org and provide both a detailed example of where to find and how to replicate the bug as well as the solution you found. This way we can continue to improve the theme and it\'s IE6 support.',NULL,1330401624,NULL,0,0),(15842,'en_us',295,'modulename','Image gallery','Image gallery',NULL,1330401624,NULL,0,0),(15843,'en_us',296,'cannotloadquestioninfo','Unable to load questiontype specific question information','Unable to load questiontype specific question information',NULL,1330401624,NULL,0,0),(15844,'en_us',296,'essayonly','The following questions need to be graded manually','The following questions need to be graded manually',NULL,1330401624,NULL,0,0),(15845,'en_us',296,'gradeall','Grade all {$a} attempts','Grade all {$a} attempts',NULL,1330401624,NULL,0,0),(15846,'en_us',296,'graded','(graded)','(graded)',NULL,1330401624,NULL,0,0),(15847,'en_us',296,'gradenextungraded','Grade next {$a} ungraded attempts','Grade next {$a} ungraded attempts',NULL,1330401624,NULL,0,0),(15848,'en_us',296,'gradeungraded','Grade all {$a} ungraded attempts','Grade all {$a} ungraded attempts',NULL,1330401624,NULL,0,0),(15849,'en_us',296,'grading','Manual grading','Manual grading',NULL,1330401624,NULL,0,0),(15850,'en_us',296,'gradingall','All {$a} attempts on this question.','All {$a} attempts on this question.',NULL,1330401624,NULL,0,0),(15851,'en_us',296,'gradingattempt','Attempt number {$a->attempt} for {$a->fullname}','Attempt number {$a->attempt} for {$a->fullname}',NULL,1330401624,NULL,0,0),(15852,'en_us',296,'gradingnextungraded','Next {$a} ungraded attempts','Next {$a} ungraded attempts',NULL,1330401624,NULL,0,0),(15853,'en_us',296,'gradingnotallowed','You do not have permission to manually grade responses in this quiz','You do not have permission to manually grade responses in this quiz',NULL,1330401624,NULL,0,0),(15854,'en_us',296,'gradingreport','Manual grading report','Manual grading report',NULL,1330401624,NULL,0,0),(15855,'en_us',296,'gradingungraded','{$a} ungraded attempts',